INSERT INTO ezcontentobject_attribute VALUES (115,'eng-GB',1,38,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (85,'eng-GB',1,40,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>eZ publish 3 is the next generation of the popular open source content management system eZ publish. This version of eZ publish, though, is not only a totally re-engineered version with a lot of new, exciting functionality. eZ publish 3 has evolved into a development platform with several general PHP libraries for the rapid building of all sorts of PHP applications. Best of all: eZ publish is available for free under the GPL license. The latest version of eZ publish can be downloaded from ez.no at all times. </paragraph>\n  <paragraph>The eZ publish 3 development framework is a feature rich package. The libraries handles common operations including database abstraction, internationalization, template engine for content and design separation, XML parser and SOAP library. On top of the libraries you get the ready to use publishing functionality available in the eZ publish kernel. You have user defined content, integrated role based permission system, multilanguage features including UNICODE support, versioning of content, workflows, integrated search engine and an a full feature e-commerce engine to mention some features. </paragraph>\n  <paragraph>This article will show you how quickly you can set up eZ publish and how you can create custom websites with dynamic content. We will have a look at one content class and see how this is defined and how you can use it</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (86,'eng-GB',1,40,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Installing</header>\n    <paragraph>You have basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL and set up everything needed to get eZ publish up and running. Another option is to use the publish sources and follow the setup wizard which will guide you through the steps of configuring your system for eZ publish. If you are a litle more experienced you can disable the setup wizard and configure eZ publish from scratch following the installation manual. If you don&apos;t want to install eZ publish yourself you can always hire eZ systems to install the software for you or buy a ready hosted eZ publish solution. We&apos;re not going to go into details about the installation here, you will find all the information you need in the installation manual. </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (116,'eng-GB',1,40,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (87,'eng-GB',1,41,127,'Setting up',0,0);
INSERT INTO ezcontentobject_attribute VALUES (88,'eng-GB',1,41,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Once you&apos;ve gotten eZ publish up and running on a server you need to configure the system. You can have several different sites running on the same eZ publish installation, to distinguish between these sites you need to set up something called site access. The site access defines how eZ publish will recognize which site you&apos;re accessing. eZ publish will then know which database to use, which design to show etc. There are four ways of letting eZ publish recognize a site access, by URI, host name, port or file name. The most common way is to use the host name. </paragraph>\n  <paragraph>In our example we will name our site www.mybookstore.com and we will use the admin.mybookstore.com as the administration interface. To make eZ publish fetch site access from host names you need to configure a DNS server and point the domains to your web server. When your DNS is up and running and the names resolve to your web server and your eZ publish installation you need to make eZ publish recognize the names and use the correct configuration. To do this you open the configuration file found in settings/site.ini in the root of your eZ publish installation. In site.ini browse down to the section [SiteAccessSettings] and alter the configuration like shown below. Only the settings you need to change is shown below. </paragraph>\n  <paragraph>\n    <line>[SiteAccessSettings]</line>\n    <line>MatchOrder=host</line>\n    <line>HostMatchRegexp=^(.+)\\.mybookstore\\.com$</line>\n    <line>HostMatchSubtextPost=\\.mybookstore\\.com</line>\n  </paragraph>\n  <paragraph> We&apos;ve now told eZ publish to look for the first characters in our domain name. This means that you will get the matches www for the website and admin for the administration site. Now that eZ publish knows how to distinguish between the two domains we need to create a configuration file for each site. This is done by creating two folders under settings/siteaccess/ which corresponds to our matches ( www and admin ). In both these folder you need to create a file called site.ini.append. This is the configuration file which will be used to override any of the standard settings in eZ publish. We will keep our example simple and have just made a few settings distinguish bewteen the two sites. You can see the two configuration files below. </paragraph>\n  <paragraph>\n    <line>Contents of configuration for admin site settings/siteaccess/admin/site.ini.append</line>\n    <line>[SiteSettings]</line>\n    <line>LoginPage=custom</line>\n  </paragraph>\n  <paragraph>\n    <line>[SiteAccessSettings]</line>\n    <line>RequireUserLogin=true</line>\n  </paragraph>\n  <paragraph> The configuration LoginPage=custom means that eZ publish will use a separate template for the login page of the administration site. RequireUserLogin=true tells eZ publish not to let anyone inside eZ publish unless they&apos;re logged into the system. </paragraph>\n  <paragraph>Contents of configuration for website settings/siteaccess/www/site.ini.append</paragraph>\n  <paragraph>\n    <line>[DesignSettings]</line>\n    <line>SiteDesign=mybookstore</line>\n  </paragraph>\n  <paragraph>\n    <line>[SiteAccessSettings]</line>\n    <line>RequireUserLogin=false</line>\n  </paragraph>\n  <paragraph> The settings above applies to the website. SiteDesign=mybookstore means that eZ publish will prefer to use the design for the site found in design/mybookstore, RequireUserLogin=false is set so that users do not have to log into eZ publish to browse the website.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (89,'eng-GB',1,42,127,'Applying design',0,0);
INSERT INTO ezcontentobject_attribute VALUES (90,'eng-GB',1,42,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <strong>Note:</strong> When developing templates you should disable the view cache. When this is enabled, the template engine does not check the modification date of the templates, thus you will not see any changes. Edit settings/site.ini and set ViewCaching=disabled in [ContentSettings]. </paragraph>\n  <paragraph>\n    <line>The main template in eZ publish is called pagelayout.tpl and is located in the templates/ folder or the current design folder. In our example this is design/mybookstore/templates/pagelayout.tpl. This template defines the layout of our website. Here you normally decide where your logo and menu goes. We will make our pagelayout template simple with a heading, a menu with two links and the content itself. Below you will see the complete code for our template. </line>\n    <literal>\n{*?template charset=latin1?*}\n&lt;!DOCTYPE html PUBLIC &quot;-//W3C//DTD XHTML 1.0 Transitional//EN&quot;\n    &quot;http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd&quot;&gt;\n&lt;html xmlns=&quot;http://www.w3.org/1999/xhtml&quot; xml:lang=&quot;en&quot; lang=&quot;en&quot;&gt;\n&lt;head&gt;\n    &lt;title&gt;Price Update System&lt;/title&gt;\n    &lt;link rel=&quot;stylesheet&quot; type=&quot;text/css&quot; href={&quot;stylesheets/core.css&quot;|ezdesign} /&gt;\n&lt;/head&gt;\n&lt;body&gt;\n&lt;h1&gt;My Bookstore&lt;/h1&gt;\n&lt;table width=&quot;100%&quot;&gt;\n&lt;tr&gt;\n    &lt;td valign=&quot;top&quot;&gt;\n    &lt;a href={&quot;content/view/full/16/&quot;|ezurl}&gt;Books&lt;/a&gt;&lt;br /&gt;\n    &lt;a href={&quot;content/view/full/17/&quot;|ezurl}&gt;News&lt;/a&gt;\n    &lt;/td&gt;\n    &lt;td valign=&quot;top&quot;&gt;\n    {$module_result.content}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n</literal>\n  </paragraph>\n  <paragraph> This template consists mainly of XHTML but there are some special codes in this template, which makes it dynamic. All these codes start with a { and ends with a }. These codes are parsed by the template engine in eZ publish and makes the template dynamic. To start at the top we see that we have a template definition {*?template charset=latin1?*}, this defines the charset we use in this template. Latin1 is the most common character set used, if you need an other character set like UTF-8 (UNICODE) you need to specify this here. This only specifies what kind of character set used in the template. </paragraph>\n  <paragraph>When we include the stylesheet we use a template operator, ezdesign, {&quot;stylesheets/core.css&quot;|ezdesign}. This operator tells eZ publish to look for the stylesheet stylesheets/core.css in the current design folder. In our case this is design/mybookstore/stylesheets/core.css. This is a handy function to use when you want templates to work with different designs and it also takes care of url translation if you have eZ publish installed in a subfolder of your site or do not use a virtual host configuration. E.g. www.mybookstore.com/ezpublishsite/index.php/content/view/full/42. </paragraph>\n  <paragraph>A similar template operator is used in our url&apos;s {&quot;content/view/full/16/&quot;|ezurl}. The ezurl operator will convert relative links to real links and it will also handle non virtual host setups in the same manner as the ezdesign operator. In our menu we have linked to two folders that we have created. We will use these folders as containers for our products and news. </paragraph>\n  <paragraph>In our template we also have the template variable {$module_result.content}. This will put the contents served by eZ publish in this position. Typically this is the information about a product or an article you display, a list of articles or the search result page. In short any page you view will use the pagelayout.tpl. You can also have different pagelayout.tpl files for different parts of your site or dynamically change it based on e.g. the current user, but we&apos;re not going to go into detail about this here. </paragraph>\n</section>',1045487555,0);
