creating two folders under settings/siteaccess/ which corresponds to our matches ( www and admin ). In both these folder you need to create a file called site.ini.append. This is the configuration file which will be used to override any of the standard settings in eZ publish. We will keep our example simple and have just made a few settings distinguish bewteen the two sites. You can see the two configuration files below.</paragraph>\n  <paragraph>\n    <literal>\nContents of configuration for admin site settings/siteaccess/admin/site.ini.append\n[SiteSettings]\nLoginPage=custom\n\n[SiteAccessSettings]\nRequireUserLogin=true\n</literal>\n  </paragraph>\n  <paragraph>The configuration LoginPage=custom means that eZ publish will use a separate template for the login page of the administration site. RequireUserLogin=true tells eZ publish not to let anyone inside eZ publish unless they&apos;re logged into the system.</paragraph>\n  <paragraph>\n    <literal>\nContents of configuration for website settings/siteaccess/www/site.ini.append\n\n[DesignSettings]\nSiteDesign=mybookstore\n\n[SiteAccessSettings]\nRequireUserLogin=false\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>The settings above applies to the website. SiteDesign=mybookstore means that eZ publish will prefer to use the design for the site found in design/mybookstore, RequireUserLogin=false is set so that users do not have to log into eZ publish to browse the website.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (89,'eng-GB',2,42,127,'Applying design',0,0);
INSERT INTO ezcontentobject_attribute VALUES (90,'eng-GB',2,42,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <strong>Note:</strong> When developing templates you should disable the view cache. When this is enabled, the template engine does not check the modification date of the templates, thus you will not see any changes. Edit settings/site.ini and set ViewCaching=disabled in [ContentSettings].</paragraph>\n  <paragraph>\n    <line>The main template in eZ publish is called pagelayout.tpl and is located in the templates/ folder or the current design folder. In our example this is design/mybookstore/templates/pagelayout.tpl. This template defines the layout of our website. Here you normally decide where your logo and menu goes. We will make our pagelayout template simple with a heading, a menu with two links and the content itself. Below you will see the complete code for our template. </line>\n    <literal>\n{*?template charset=latin1?*}\n&lt;!DOCTYPE html PUBLIC &quot;-//W3C//DTD XHTML 1.0 Transitional//EN&quot;\n    &quot;http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd&quot;&gt;\n&lt;html xmlns=&quot;http://www.w3.org/1999/xhtml&quot; xml:lang=&quot;en&quot; lang=&quot;en&quot;&gt;\n&lt;head&gt;\n    &lt;title&gt;Price Update System&lt;/title&gt;\n    &lt;link rel=&quot;stylesheet&quot; type=&quot;text/css&quot; href={&quot;stylesheets/core.css&quot;|ezdesign} /&gt;\n&lt;/head&gt;\n&lt;body&gt;\n&lt;h1&gt;My Bookstore&lt;/h1&gt;\n&lt;table width=&quot;100%&quot;&gt;\n&lt;tr&gt;\n    &lt;td valign=&quot;top&quot;&gt;\n    &lt;a href={&quot;content/view/full/16/&quot;|ezurl}&gt;Books&lt;/a&gt;&lt;br /&gt;\n    &lt;a href={&quot;content/view/full/17/&quot;|ezurl}&gt;News&lt;/a&gt;\n    &lt;/td&gt;\n    &lt;td valign=&quot;top&quot;&gt;\n    {$module_result.content}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n</literal>\n  </paragraph>\n  <paragraph>This template consists mainly of XHTML but there are some special codes in this template, which makes it dynamic. All these codes start with a { and ends with a }. These codes are parsed by the template engine in eZ publish and makes the template dynamic. To start at the top we see that we have a template definition {*?template charset=latin1?*}, this defines the charset we use in this template. Latin1 is the most common character set used, if you need an other character set like UTF-8 (UNICODE) you need to specify this here. This only specifies what kind of character set used in the template.</paragraph>\n  <paragraph>When we include the stylesheet we use a template operator, ezdesign, {&quot;stylesheets/core.css&quot;|ezdesign}. This operator tells eZ publish to look for the stylesheet stylesheets/core.css in the current design folder. In our case this is design/mybookstore/stylesheets/core.css. This is a handy function to use when you want templates to work with different designs and it also takes care of url translation if you have eZ publish installed in a subfolder of your site or do not use a virtual host configuration. E.g. www.mybookstore.com/ezpublishsite/index.php/content/view/full/42.</paragraph>\n  <paragraph>A similar template operator is used in our url&apos;s {&quot;content/view/full/16/&quot;|ezurl}. The ezurl operator will convert relative links to real links and it will also handle non virtual host setups in the same manner as the ezdesign operator. In our menu we have linked to two folders that we have created. We will use these folders as containers for our products and news.</paragraph>\n  <paragraph>\n    <line>In our template we also have the template variable {$module_result.content}. This will put the contents served by eZ publish in this position. Typically this is the information about a product or an article you display, a list of articles or the search result page. In short any page you view will use the pagelayout.tpl. You can also have different pagelayout.tpl files for different parts of your site or dynamically change it based on e.g. the current user, but we&apos;re not going to go into detail about this here.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (91,'eng-GB',1,43,127,'Defining our custom content',0,0);
INSERT INTO ezcontentobject_attribute VALUES (92,'eng-GB',1,43,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are a couple of concepts which are vital to understand when creating custom content. The first is the usage of content classes. A content class is a definition of a structure. The class is a collection of attributes. Each attribute is of a certain data type. Text line, text area, image and integer value are typical examples of data types you can use for the class attributes. For each class attribute we need to select the data type, if it&apos;s required and if it&apos;s searchable. Every class attribute also have a name, e.g. Title. When we input the name of an attribute we will automatically get something called an identifier. The identifier is a string generated from the class attribute name but can only consist of the letters a-z and numbers 0-9 in lower case and the underscore, _, character. We will later come back to what we use identifiers for.</paragraph>\n  <paragraph>A powerful feature of eZ publish is that you can define your custom content classes. As default eZ publish comes with classes to publish folders, articles and images among others. In our example we will create a new content class, book, which will define the structure of information published about books. To be able to do this you need to log into the administration interface of our site and click on the classes menu found under set up. There you select an appropriate group, e.g. content, and click new class. Name the class &quot;Book&quot; and add the needed attributes.</paragraph>\n  <paragraph>To publish information about a book we need to be able to define the title of the book, name of the author and publisher, a brief and complete description of the book, a cover image and of course the price.</paragraph>\n  <paragraph>On the class edit page, which is shown on the image below, we can create attributes by selecting the data type in the lower left corner and click on the New button. For our Book class we need to define the following attributes.</paragraph>\n  <paragraph>\n    <object id=\"44\" />\n  </paragraph>\n  <paragraph>\n    <ul>\n      <li>Title: text line</li>\n      <li>Author: text line</li>\n      <li>Publisher: text line</li>\n      <li>Brief: xml text field</li>\n      <li>Description: xml text field</li>\n      <li>Cover: image</li>\n      <li>Price: price</li>\n    </ul>\n  </paragraph>\n  <paragraph>Now that we&apos;ve created our book class we can start publishing information about books. To do this we go to the contents menu in the administration interface and click on a folder, books in my example. There you can select the class you want to use in the lower left corner and click new. That will bring you to the book edit window as shown in the image.</paragraph>\n  <paragraph>\n    <object id=\"45\" />\n  </paragraph>\n  <paragraph>When you&apos;ve published the book, you get an object. An object is the specific book, that is the information you filled in after the rules defined in the book class. When you publish an object it is automatically indexed in the search engine so it&apos;s searchable from the moment it&apos;s published.</paragraph>\n</section>',1045487555,0);
