INSERT INTO ezcontentobject_attribute VALUES (99,'eng-GB',1,46,127,'The book design',0,0);
INSERT INTO ezcontentobject_attribute VALUES (100,'eng-GB',1,46,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>We are now able to publish information about our books, it&apos;s time to apply the design. The book class gets a number (ID), which we need to use when we want to create a special design for this class. You will find this number in the class list under ID. In my case this was 6, but you need to check the number of your class.</paragraph>\n  <paragraph>In eZ publish you can view objects using different view modes. The two most common that you use on most setups is line, which is the view typically used in article lists and similar. To create a template for this view mode we need to create an override template in the folder design/mybookstore/override/templates/node/view/line called line_class_6.tpl. This is an template for line view mode overriden for class 6, hence the name line_class_6.tpl.</paragraph>\n  <paragraph>\n    <literal>\nFile: design/mybookstore/override/templates/node/view/line_class_6.tpl\n\n&lt;h2&gt;{attribute_view_gui attribute=$node.object.data_map.title}&lt;/h2&gt;\n&lt;table align=&quot;right&quot;&gt;\n&lt;tr&gt;\n   &lt;td&gt;\n    {attribute_view_gui attribute=$node.object.data_map.cover image_class=small}\n   &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n{attribute_view_gui attribute=$node.object.data_map.brief}\n{attribute_view_gui attribute=$node.object.data_map.price}\n&lt;a href={concat(&quot;/content/view/full/&quot;,$node.node_id,&quot;/&quot;)|ezurl}&gt;View book&lt;/a&gt;\n</literal>\n  </paragraph>\n  <paragraph>\n    <object id=\"47\" />\n  </paragraph>\n  <paragraph>On the picture you see how the line_class_6.tpl template displays a summary of the book. This template is normally used in lists and this is a typical example of how you would create the template for a product in a web shop. </paragraph>\n  <paragraph>In the line_class_6.tpl we have some template functions which make them dynamic. The first function we use is the attribute_view_gui function. This function takes at least one parameter attribute ( in some cases you can supply more ). The attribute parameter specifies which of the attributes in our object should be shown. In the template we have a variable, $node. The $node variable is an object which contains the specific placement of the object on our site, e.g. it will know that the object is placed in / books / in our site. The $node object also contains the content object. You can access the content object by writing $node.object. Now that we have object we would like to get access to a specific attribute to supply for the attribute_view_gui function. This is done using the data_map, $node.object.data_map, followed by the identifier of the desired attribute. To fetch the title of our book we just need to write attribute_view_gui attribute=$node.object.data_map.title, the attribute_view_gui function will then handle the display of that attribute. In the case of the attribute being an image we can supply a parameter image_class, which is optional, to define the size of the image. You can set the image_class to small, medium or large. </paragraph>\n  <paragraph>The second function we use in our template is concat(), this function will concatenate the values supplied, to a string. In our example we use the function to create a url. We then use the returned value from the concat() function with the operator ezurl, in the same manner we did with the pagelayout.tpl. </paragraph>\n  <paragraph>We also want to create an override template for the full view mode, which is used when viewing a specific book, see image below. To do this we need to create a file in the same folder but with the name full_class_6.tpl.</paragraph>\n  <paragraph>\n    <object id=\"48\" />\n  </paragraph>\n  <paragraph>\n    <literal>\nFile: design/mybookstore/override/templates/node/view/full_class_6.tpl\n\n&lt;h1&gt;{attribute_view_gui attribute=$node.object.data_map.title}&lt;/h1&gt;\nAuthor: {attribute_view_gui attribute=$node.object.data_map.author}&lt;br /&gt;\nPublisher: {attribute_view_gui attribute=$node.object.data_map.publisher}&lt;br /&gt;\n&lt;table align=&quot;right&quot;&gt;\n&lt;tr&gt;\n   &lt;td&gt;\n    {attribute_view_gui attribute=$node.object.data_map.cover}\n   &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n{attribute_view_gui attribute=$node.object.data_map.brief}\n{attribute_view_gui attribute=$node.object.data_map.description}\n&lt;b&gt;{attribute_view_gui attribute=$node.object.data_map.price}&lt;/b&gt;\n</literal>\n  </paragraph>\n  <paragraph>Now we&apos;ve created a small site on eZ publish where we can publish information about books. We would now have to work a bit more on design before we have a ready site. From these few steps the true power of eZ publish 3 is shown. You can in a simple way create highly customized websites with functionality such as search, permission checking and versioning already implemented and ready to use. </paragraph>\n  <paragraph>eZ publish is used worldwide by thousands of websites. People use eZ publish for their company sites, e-commerce sites, portals, and intranets. These functions are only some of the possibilities that will be available with eZ publish 3. You will find more information about eZ publish 3 and the many possibilities on     \n    <link id=\"1\">http://ez.no/developer</link>. </paragraph>\n</section>',1045487555,0);
