INSERT INTO ezcontentobject_attribute VALUES (120,'eng-GB',1,51,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>One of the most powerful features of eZ publish 3 is that you can define your own content classes. A content class defines the structure of the content you want to publish on your site. Examples of different content classes are; article, folder, image, product and link.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (121,'eng-GB',1,51,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Creating classes</header>\n    <paragraph>When you start to build your site you need to find the suitable structure for your content. eZ publish comes with a set of standard content classes which you can use, but you will most likely need to create your own custom classes for your specific needs.</paragraph>\n    <paragraph>Lets say we need to publish information about cars. We then need to create a class called car. The class needs the attributes; Name, Manufacturer, Model, Year, Description and Image.</paragraph>\n    <paragraph>You will find the administration interface for classes under &quot;Set up&quot; in the eZ publish administration interface. Then click on the apropriate group, e.g. content, where you want to place your class. The group is just a method of categorizing your content classes for simpler administration of larger sites. Then you click on the &quot;New class&quot; button. You will then be presented to the class edit window as shown below:</paragraph>\n    <paragraph>\n      <object id=\"52\" />\n    </paragraph>\n    <paragraph>Every class has 3 attributes; object name, identifier and name. The name is the alias for the class. The identifier is a 0-9 a-z representation of the name, this is used in templates, import/exports etc as an identifier for the class. The object name defines how an object of this class will be named. All objects get a one-line name which can consist of several values. In this examples it will be the same as the first attribute - name. </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (122,'eng-GB',1,51,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (123,'eng-GB',1,52,116,'Custom content - class edit',0,0);
INSERT INTO ezcontentobject_attribute VALUES (124,'eng-GB',1,52,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (125,'eng-GB',1,52,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (126,'eng-GB',1,53,127,'Attributes',0,0);
INSERT INTO ezcontentobject_attribute VALUES (127,'eng-GB',1,53,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>We then need to create the attributes for the car class. To add a new attribute you select the datatype for the attribute in the dropdown in the lower right corner of the class edit page. Every attribute has a name and an identifier. You only need to fill in the name, the identifier will automatically be generated. Attributes are by default searchable, this means that the data entered here will be indexed in the search engine. You can also select if the attribute is required or not. Additionally some datatypes have aditional settings, like default value and max string length for text line. </paragraph>\n  <paragraph>For our car class we will create datatypes of &quot;Text line&quot;, &quot;XML text&quot; and image. </paragraph>\n  <paragraph>\n    <ul>\n      <li>Name: Text line</li>\n      <li>Manufacturer: Text line</li>\n      <li>Model: Text line</li>\n      <li>Year: Text line</li>\n      <li>Description: XML text</li>\n      <li>Image: Image</li>\n    </ul>\n  </paragraph>\n  <paragraph>Now that we&apos;ve created all our attributes we can just click on the store button and our class is ready to use. </paragraph>\n  <paragraph>\n    <strong>Note: To make objects of the new class available to anonymous users you must edit the Anonymous role, as this role has specified access limitation by class by default.</strong>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (129,'eng-GB',1,54,127,'Creating content',0,0);
INSERT INTO ezcontentobject_attribute VALUES (130,'eng-GB',1,54,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>To take our newly created class for a spin we click on the content menu in the administration interface. You then browse to a suitable placement and select &quot;New car&quot;. This will bring us to the object edit window shown below. Here you fill in all the values you want for you car and click &quot;Send for publishing&quot;.</paragraph>\n  <paragraph>\n    <object id=\"55\" />\n  </paragraph>\n  <paragraph>Now we&apos;ve already published our own custom content without changing any code just clicking in the web interface. When we view our newly created it will display with the standard templates as shown below</paragraph>\n  <paragraph>\n    <object id=\"56\" />\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (131,'eng-GB',1,55,116,'Creating content - object edit',0,0);
INSERT INTO ezcontentobject_attribute VALUES (132,'eng-GB',1,55,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (133,'eng-GB',1,55,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (134,'eng-GB',1,56,116,'Creating content - object view plain',0,0);
INSERT INTO ezcontentobject_attribute VALUES (135,'eng-GB',1,56,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (136,'eng-GB',1,56,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (137,'eng-GB',1,57,127,'Custom template',0,0);
INSERT INTO ezcontentobject_attribute VALUES (138,'eng-GB',1,57,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <strong>Note:</strong> When developing templates you should disable the view cache. When this is enabled, the template engine does not check the modification date of the templates, thus you will not see any changes. Edit settings/site.ini and set ViewCaching=disabled in [ContentSettings].</paragraph>\n  <paragraph>The standard template is not how we want our car to be displayed at our webpage. Now we need to get our hands dirty, and create a display template. To create a specific we need to figure out the ID of our class. The ID is a unique number which represents our class. This can be found in the class list under &quot;Set up -&gt; classes&quot;. In my case this was 26.</paragraph>\n  <paragraph>To make eZ publish understand that you want to have a custom template for your newly created class you must create an override template for this. You can do this by creating a file in the eZ publish root. The eZ publish root is the main folder of your eZ publish installation. There you will see the sub folders, lib, kernel, design etc. The file should be created under the design folder:</paragraph>\n  <paragraph>\n    <literal>\nUnix:\ndesign/standard/override/templates/node/view/full_class_26.tpl\nWindows:\ndesign\\standard\\override\\templates\\node\\view\\full_class_26.tpl\n</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Note: </strong> If you don&apos;t have the subfolders override/templates/node/view, these must be created under your design folder ( which is design/standard/ as default ).</paragraph>\n  <paragraph>This file is a plain text file which you can edit with your favourite text editor, e.g. vi, emacs and notepad. It must be a plain text editor with no formatting, so you cannot use word processors like word or open office.</paragraph>\n  <paragraph>Replace standard with your current design folder and 26 with the ID of your class.</paragraph>\n  <paragraph>This .tpl file is a eZ publish 3 template file and is a combination of XHTML and eZ template syntax. The example below shows a simple customisation where we place the attributes in a table and have a large image under the page title.</paragraph>\n  <paragraph>\n    <literal>&lt;h1&gt;{$node.name}&lt;/h1&gt;\n\n{attribute_view_gui attribute=$node.object.data_map.image}\n\n&lt;table&gt;\n&lt;tr&gt;\n    &lt;td&gt;\n    Manufacturer:\n    &lt;/td&gt;\n    &lt;td&gt;\n    {attribute_view_gui attribute=$node.object.data_map.manufacturer}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n    &lt;td&gt;\n    Model:\n    &lt;/td&gt;\n    &lt;td&gt;\n    {attribute_view_gui attribute=$node.object.data_map.model}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n    &lt;td&gt;\n    Year:\n    &lt;/td&gt;\n    &lt;td&gt;\n    {attribute_view_gui attribute=$node.object.data_map.year}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n\n{attribute_view_gui attribute=$node.object.data_map.description}\n</literal>\n  </paragraph>\n  <paragraph>In the example above you see that we use the template variable {$node} whenever we want to fetch some data from our object. The node represents the specific placement of our object. E.g. if it&apos;s published under /frontpage/news/ that will be a node. We can fetch the object name using {$node.name}. This is the automatically generated name for the object which we configured to be equal to the attribute: name. The function {attribute_view_gui } is a template function used for fetching the content of a specific attribute. You use the attribute identifier to specify the attribute.</paragraph>\n  <paragraph>\n    <line>The image below shows our car using the custom template.</line>\n    <object id=\"58\" />\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (139,'eng-GB',1,58,116,'Creating content - object_view_custom',0,0);
INSERT INTO ezcontentobject_attribute VALUES (140,'eng-GB',1,58,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
