INSERT INTO ezcontentobject_attribute VALUES (142,'eng-GB',1,59,124,'Common Template Issues',0,0);
INSERT INTO ezcontentobject_attribute VALUES (143,'eng-GB',1,59,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Here you will find examples of some features you are likely to need when developing your own templates. Consult the eZ template documentation for the complete documentation of the template engine.</paragraph>\n  <paragraph>In this example we will create an override template for the &apos;full&apos; view mode of the Folder class. To test it, create a file called &apos;full_class_1.tpl&apos; in the directory &apos;design/admin/override/templates/node/view&apos;. Login to the admin interface, create a test folder, and fill it with some articles.</paragraph>\n  <paragraph>\n    <line>\n      <strong>Note:</strong> When developing templates you should disable the view cache. When this is enabled, the template engine does not check the modification date of the templates, thus you will not see any changes. Edit settings/site.ini and set ViewCaching=disabled in [ContentSettings].</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (144,'eng-GB',1,59,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Just a list</header>\n    <paragraph>This example simply lists out the names of the articles who are children of the folder we are viewing. The fetch statement fetches a list of children whose parent node id equals our node id, and assigns it to the template variable $children. The name of our node is printed as a header, and then we use a loop to print the name of each child. Looping is done with the section function. Note how we assign a namespace for the loop, called &apos;Child&apos; in this example.</paragraph>\n    <paragraph>\n      <literal>{* set children variable *}\n{let children=fetch(&apos;content&apos;,list,hash(parent_node_id,$node.node_id))}\n\n&lt;h1&gt;{$node.name}&lt;/h1&gt;\n\n{* loop children and print name *}\n{section name=Child loop=$children}\n{$Child:item.name}&lt;br&gt;\n{/section}\n\n{/let}\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>This will output something like this:</line>\n      <object id=\"60\" />\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (145,'eng-GB',1,59,143,'',0,0);
