INSERT INTO ezcontentobject_attribute VALUES (143,'eng-GB',2,59,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Here you will find examples of some features you are likely to need when developing your own templates. Consult the eZ template documentation for the complete documentation of the template engine.</paragraph>\n  <paragraph>In this example we will create an override template for the &apos;full&apos; view mode of the Folder class. To test it, create a file called &apos;full_class_1.tpl&apos; in the directory &apos;design/admin/override/templates/node/view&apos;. Login to the admin interface, create a test folder, and fill it with some articles.</paragraph>\n  <paragraph>\n    <line>\n      <strong>Note:</strong> When developing templates you should disable the view cache. When this is enabled, the template engine does not check the modification date of the templates, thus you will not see any changes. Edit settings/site.ini and set ViewCaching=disabled in [ContentSettings].</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (144,'eng-GB',2,59,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Just a list</header>\n    <paragraph>This example simply lists out the names of the articles who are children of the folder we are viewing. The fetch statement fetches a list of children whose parent node id equals our node id, and assigns it to the template variable $children. The name of our node is printed as a header, and then we use a loop to print the name of each child. Looping is done with the section function. Note how we assign a namespace for the loop, called &apos;Child&apos; in this example.</paragraph>\n    <paragraph>\n      <literal>{* set children variable *}\n{let children=fetch(&apos;content&apos;,list,hash(parent_node_id,$node.node_id))}\n\n&lt;h1&gt;{$node.name}&lt;/h1&gt;\n\n{* loop children and print name *}\n{section name=Child loop=$children}\n{$Child:item.name}&lt;br&gt;\n{/section}\n\n{/let}\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>This will output something like this:</line>\n      <object id=\"60\" />\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (145,'eng-GB',2,59,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (149,'eng-GB',1,61,127,'A list with links to children',0,0);
INSERT INTO ezcontentobject_attribute VALUES (150,'eng-GB',1,61,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>In the second example we will output links to the child objects, not just their names. We use the function &apos;node_view_gui&apos; to print the child objects, and select the &apos;line&apos; view mode.</paragraph>\n  <paragraph>\n    <literal>\n{* set children variable *}\n{let children=fetch(&apos;content&apos;,list,hash(parent_node_id,$node.node_id))}\n\n&lt;h1&gt;{$node.name}&lt;/h1&gt;\n\n{* loop children and show line view *}\n{section name=Child loop=$children}\n{node_view_gui view=line content_node=$Child:item}&lt;br&gt;\n{/section}\n\n{/let}\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>This will output something like this:</line>\n    <object id=\"62\" />\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (151,'eng-GB',1,62,116,'Common template issues - templateissues02',0,0);
INSERT INTO ezcontentobject_attribute VALUES (152,'eng-GB',1,62,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (153,'eng-GB',1,62,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (154,'eng-GB',1,63,127,'A more complex list',0,0);
INSERT INTO ezcontentobject_attribute VALUES (155,'eng-GB',1,63,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Since this is a news page example, we will now try some functionality that might be used on a news site. We show the two most recent news titles on the top, with the ingress, and a link to the full article. For the remaing articles we simply show the name, linked to the full article, as in the previous example. To achieve this we use the &apos;max&apos; and &apos;offset&apos; input parameters. In the first loop we set &apos;max=2&apos;, meaning that up to two items will be show in this loop. In the second loop we set &apos;offset=2&apos;, meaning that this loop will start two items from the beginning of the list, in other words with the third item.</paragraph>\n  <paragraph>We also use the &apos;delimiter&apos; function to show the remaing articles in a two-column list. The delimiter function is used when we want to do something between each item in a loop. In this case we output the closing and starting -tags. We set &apos;modulo=2&apos; for the delimiter, meaning that the delimiter will only be used for every second list item. Thus, this part of the table will contain two cells per row.</paragraph>\n  <paragraph>\n    <literal>{* set children variable *}\n{let children=fetch(&apos;content&apos;,list,hash(parent_node_id,$node.node_id))}\n\n&lt;h1&gt;{$node.name}&lt;/h1&gt;\n\n&lt;table border=&apos;0&apos;&gt;\n{section name=Child loop=$children max=2}\n  &lt;tr&gt;\n    &lt;td colspan=&quot;2&quot;&gt;\n      &lt;h2&gt;{$Child:item.name}&lt;/h2&gt;\n      &lt;p&gt;{$Child:item.data_map.intro.data_text}&lt;/p&gt;\n      &lt;p&gt;&lt;a href={concat(&quot;/content/view/full/&quot;,$Child:item.node_id)|ezurl}&gt;Read more...&lt;/a&gt;&lt;/p&gt;\n    &lt;/td&gt;\n  &lt;/tr&gt;\n{/section}\n\n  &lt;tr&gt;\n    &lt;td colspan=&quot;2&quot;&gt;\n      &lt;h2&gt;More news:&lt;/h2&gt;\n    &lt;/td&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n{section name=Child loop=$children offset=2}\n    &lt;td&gt;\n    {node_view_gui view=line content_node=$Child:item}\n    &lt;/td&gt;\n  {delimiter modulo=2}\n  &lt;/tr&gt;\n  &lt;tr&gt;\n  {/delimiter}\n{/section}\n  &lt;/tr&gt;\n&lt;/table&gt;\n\n{/let}\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>This will output something like this:</line>\n    <object id=\"65\" />\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (156,'eng-GB',1,64,116,'',0,0);
