INSERT INTO ezcontentobject_attribute VALUES (159,'eng-GB',1,65,116,'Common template issues - templateissues03',0,0);
INSERT INTO ezcontentobject_attribute VALUES (160,'eng-GB',1,65,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (161,'eng-GB',1,65,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (162,'eng-GB',1,66,127,'A even more complex list - with colours',0,0);
INSERT INTO ezcontentobject_attribute VALUES (163,'eng-GB',1,66,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>In the final example we set alternating colours for the lines in the list, using the &apos;sequence&apos; function. Sequence is used two loop trough a list, and wrap around when the end is reached. This is very useful for alternating colours. We set two parameters, the namespace and the array of items to loop. (In this case the array contains four items, allthough we only use two colours. This is because the section loops over table cells, and there are two cells per line.) We get the current sequence item using the namespace and &apos;item&apos;, and we advance to the next item by calling sequence again with the same namespace.</paragraph>\n  <paragraph>\n    <literal>\n{* set children variable *}\n{let children=fetch(&apos;content&apos;,list,hash(parent_node_id,$node.node_id))}\n\n&lt;h1&gt;{$node.name}&lt;/h1&gt;\n\n&lt;table border=&apos;0&apos;&gt;\n{section name=Child loop=$children max=2}\n  &lt;tr&gt;\n    &lt;td colspan=&quot;2&quot;&gt;\n      &lt;h2&gt;{$Child:item.name}&lt;/h2&gt;\n      &lt;p&gt;{$Child:item.data_map.intro.data_text}&lt;/p&gt;\n      &lt;p&gt;&lt;a href={concat(&quot;/content/view/full/&quot;,$Child:item.node_id)|ezurl}&gt;Read more...&lt;/a&gt;&lt;/p&gt;\n    &lt;/td&gt;\n  &lt;/tr&gt;\n{/section}\n\n  &lt;tr&gt;\n    &lt;td colspan=&quot;2&quot;&gt;\n      &lt;h2&gt;More news:&lt;/h2&gt;\n    &lt;/td&gt;\n  &lt;/tr&gt;\n  &lt;tr&gt;\n{sequence name=Seq loop=array(&quot;#A0FFA0&quot;,&quot;#A0FFA0&quot;,&quot;#D0FFD0&quot;,&quot;#D0FFD0&quot;)}\n{section name=Child loop=$children offset=2}\n    &lt;td bgcolor=&quot;{$Seq:item}&quot;&gt;\n    {node_view_gui view=line content_node=$Child:item}\n    &lt;/td&gt;\n{* Get next item in the sequence *}\n{sequence name=Seq}\n  {delimiter modulo=2}\n  &lt;/tr&gt;\n  &lt;tr&gt;\n  {/delimiter}\n{/section}\n  &lt;/tr&gt;\n&lt;/table&gt;\n\n{/let}\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>This will output something like this:</line>\n    <object id=\"67\" />\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (164,'eng-GB',1,67,116,'Common template issues - templateissues04',0,0);
INSERT INTO ezcontentobject_attribute VALUES (165,'eng-GB',1,67,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (166,'eng-GB',1,67,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (167,'eng-GB',1,68,124,'Custom workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (168,'eng-GB',1,68,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>One of the most powerful features of eZ publish 3 is that you can create custom workflows. Workflow is a mechanism that makes it possible to customize or add new features to operations in eZ Publish. For example: add some additional actions to publish routing or some additional steps to view objects. </paragraph>\n  <paragraph>Workflows should be connected to defined eZ Publish operations with triggers (there are only two defined operations in the content module currently: &quot;Read&quot; and &quot;Publish&quot;). For each defined operation, the eZ Publish kernel tries to execute two triggers. One is activated before the actual operation body is executed and another is activated after that. A trigger is just a row stored in the database table eztrigger. </paragraph>\n  <paragraph>\n    <literal>\nTable definition:\n\nCREATE TABLE eztrigger (\n  id int(11) NOT NULL auto_increment,\n  name varchar(255),\n  module_name varchar(200) NOT NULL default &apos;&apos;,\n  function_name varchar(200) NOT NULL default &apos;&apos;,\n  workflow_id int(11) default NULL,\n  PRIMARY KEY  (id),\n  UNIQUE KEY eztrigger_def_id (module_name,function_name,name)\n) TYPE=MyISAM;\n</literal>\n  </paragraph>\n  <paragraph>Field &quot;name&quot; is the name of the trigger, for example, &quot;pre_publish&quot; or &quot;pre_read&quot;. The fields module_name and function_name are the names of module and function that the system will start executing the workflow for. </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (169,'eng-GB',1,68,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Understanding Operations</header>\n    <paragraph>An operation is a sequence of functions and triggers which should be executed to make a full action like read or publish. For example, simple &quot;read&quot; operation (below) is just a sequence of &quot;pre_read&quot; trigger and &quot;fetch-object&quot; method. </paragraph>\n    <paragraph>\n      <literal>\n$OperationList[&apos;read&apos;] = array( &apos;name&apos; =&gt; &apos;read&apos;,\n                                &apos;default_call_method&apos; =&gt; array( &apos;include_file&apos; =&gt; &apos;kernel/content/ezcontentoperationcollection.php&apos;,\n                                                                &apos;class&apos; =&gt; &apos;eZContentOperationCollection&apos; ),\n                                &apos;parameters&apos; =&gt; array( array( &apos;name&apos; =&gt; &apos;node_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;user_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;language_code&apos;,\n                                                              &apos;default&apos; =&gt; &apos;&apos;,\n                                                              &apos;required&apos; =&gt; false ) ),\n                                &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                 &apos;user_id&apos; ),\n\n                                &apos;body&apos; =&gt; array( array( &apos;type&apos; =&gt; &apos;trigger&apos;,\n                                                        &apos;name&apos; =&gt; &apos;pre_read&apos;,\n                                                        &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                                         &apos;user_id&apos;\n                                                                         ) ),\n\n                                                 array( &apos;type&apos; =&gt; &apos;method&apos;,\n                                                        &apos;name&apos; =&gt; &apos;fetch-object&apos;,\n                                                        &apos;frequency&apos; =&gt; &apos;once&apos;,\n                                                        &apos;method&apos; =&gt; &apos;readObject&apos;,\n                                                        ) ) );\n\n </literal>\n    </paragraph>\n    <paragraph>\n      <ul>\n        <li>\n          <line>name - the name of the operation.</line>\n          <line>default_call_method - an array which shows in which file and class methods used in the operation are defined</line>\n        </li>\n        <li>parameters - parameters that are passed to each method and trigger in the operation when they are executed</li>\n        <li>keys - part of parameters that are used to identify stored interrupted operation (operation memento)</li>\n        <li>body - array of arrays that describe methods and triggers of the operation</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <strong>Types of body elements</strong>\n    </paragraph>\n    <paragraph>\n      <line>Trigger: </line>\n      <ul>\n        <li>type - trigger, shows that current body element is trigger</li>\n        <li>name - name of the trigger used to fetch trigger from database. To fetch the trigger, the system will use next conditions - (module name, operation name, trigger name)</li>\n        <li>key - part of the parameters used to identify running workflow process</li>Method:         \n        <li>type - method</li>\n        <li>name - fetch-object, name of method used in internals of operation</li>\n        <li>frequency - once, it means that method will be run only once</li>\n      </ul>\n    </paragraph>\n    <paragraph>&gt;method - method of class described with &quot;default_call_method&quot; &quot;class&quot; parameter of operation. That function is the code which will be executed</paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (170,'eng-GB',1,68,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (167,'eng-GB',2,68,124,'Custom workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (168,'eng-GB',2,68,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>One of the most powerful features of eZ publish 3 is that you can create custom workflows. Workflow is a mechanism that makes it possible to customize or add new features to operations in eZ Publish. For example: add some additional actions to publish routing or some additional steps to view objects.</paragraph>\n  <paragraph>Workflows should be connected to defined eZ Publish operations with triggers (there are only two defined operations in the content module currently: &quot;Read&quot; and &quot;Publish&quot;). For each defined operation, the eZ Publish kernel tries to execute two triggers. One is activated before the actual operation body is executed and another is activated after that. A trigger is just a row stored in the database table eztrigger.</paragraph>\n  <paragraph>\n    <literal>\nTable definition:\n\nCREATE TABLE eztrigger (\n  id int(11) NOT NULL auto_increment,\n  name varchar(255),\n  module_name varchar(200) NOT NULL default &apos;&apos;,\n  function_name varchar(200) NOT NULL default &apos;&apos;,\n  workflow_id int(11) default NULL,\n  PRIMARY KEY  (id),\n  UNIQUE KEY eztrigger_def_id (module_name,function_name,name)\n) TYPE=MyISAM;\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>Field &quot;name&quot; is the name of the trigger, for example, &quot;pre_publish&quot; or &quot;pre_read&quot;. The fields module_name and function_name are the names of module and function that the system will start executing the workflow for.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (169,'eng-GB',2,68,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Understanding Operations</header>\n    <paragraph>An operation is a sequence of functions and triggers which should be executed to make a full action like read or publish. For example, simple &quot;read&quot; operation (below) is just a sequence of &quot;pre_read&quot; trigger and &quot;fetch-object&quot; method.</paragraph>\n    <paragraph>\n      <literal>\n$OperationList[&apos;read&apos;] = array( &apos;name&apos; =&gt; &apos;read&apos;,\n                                &apos;default_call_method&apos; =&gt; array( &apos;include_file&apos; =&gt; &apos;kernel/content/ezcontentoperationcollection.php&apos;,\n                                                                &apos;class&apos; =&gt; &apos;eZContentOperationCollection&apos; ),\n                                &apos;parameters&apos; =&gt; array( array( &apos;name&apos; =&gt; &apos;node_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;user_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;language_code&apos;,\n                                                              &apos;default&apos; =&gt; &apos;&apos;,\n                                                              &apos;required&apos; =&gt; false ) ),\n                                &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                 &apos;user_id&apos; ),\n\n                                &apos;body&apos; =&gt; array( array( &apos;type&apos; =&gt; &apos;trigger&apos;,\n                                                        &apos;name&apos; =&gt; &apos;pre_read&apos;,\n                                                        &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                                         &apos;user_id&apos;\n                                                                         ) ),\n\n                                                 array( &apos;type&apos; =&gt; &apos;method&apos;,\n                                                        &apos;name&apos; =&gt; &apos;fetch-object&apos;,\n                                                        &apos;frequency&apos; =&gt; &apos;once&apos;,\n                                                        &apos;method&apos; =&gt; &apos;readObject&apos;,\n                                                        ) ) );\n\n </literal>\n    </paragraph>\n    <paragraph>\n      <ul>\n        <li>\n          <line>name - the name of the operation.</line>\n          <line>default_call_method - an array which shows in which file and class methods used in the operation are defined</line>\n        </li>\n        <li>parameters - parameters that are passed to each method and trigger in the operation when they are executed</li>\n        <li>keys - part of parameters that are used to identify stored interrupted operation (operation memento)</li>\n        <li>body - array of arrays that describe methods and triggers of the operation</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <strong>Types of body elements</strong>\n    </paragraph>\n    <paragraph>\n      <line>Trigger: </line>\n      <ul>\n        <li>type - trigger, shows that current body element is trigger</li>\n        <li>name - name of the trigger used to fetch trigger from database. To fetch the trigger, the system will use next conditions - (module name, operation name, trigger name)</li>\n        <li>key - part of the parameters used to identify running workflow process</li>\n        <li />\n        <li>type - method</li>\n        <li>name - fetch-object, name of method used in internals of operation</li>\n        <li>frequency - once, it means that method will be run only once</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <line>&gt;method - method of class described with &quot;default_call_method&quot; &quot;class&quot; parameter of operation. That function is the code which will be executed</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (170,'eng-GB',2,68,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (119,'eng-GB',2,51,124,'Custom content',0,0);
INSERT INTO ezcontentobject_attribute VALUES (120,'eng-GB',2,51,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>One of the most powerful features of eZ publish 3 is that you can define your own content classes. A content class defines the structure of the content you want to publish on your site. Examples of different content classes are; article, folder, image, product and link.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (121,'eng-GB',2,51,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Creating classes</header>\n    <paragraph>When you start to build your site you need to find the suitable structure for your content. eZ publish comes with a set of standard content classes which you can use, but you will most likely need to create your own custom classes for your specific needs.</paragraph>\n    <paragraph>Lets say we need to publish information about cars. We then need to create a class called car. The class needs the attributes; Name, Manufacturer, Model, Year, Description and Image.</paragraph>\n    <paragraph>You will find the administration interface for classes under &quot;Set up&quot; in the eZ publish administration interface. Then click on the apropriate group, e.g. content, where you want to place your class. The group is just a method of categorizing your content classes for simpler administration of larger sites. Then you click on the &quot;New class&quot; button. You will then be presented to the class edit window as shown below:</paragraph>\n    <paragraph>\n      <object id=\"52\" />\n    </paragraph>\n    <paragraph>\n      <line>Every class has 3 attributes; object name, identifier and name. The name is the alias for the class. The identifier is a 0-9 a-z representation of the name, this is used in templates, import/exports etc as an identifier for the class. The object name defines how an object of this class will be named. All objects get a one-line name which can consist of several values. In this examples it will be the same as the first attribute - name.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (122,'eng-GB',2,51,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (119,'eng-GB',3,51,124,'Custom content',0,0);
