ct, name of method used in internals of operation</li>\n        <li>frequency - once, it means that method will be run only once</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <line>&gt;method - method of class described with &quot;default_call_method&quot; &quot;class&quot; parameter of operation. That function is the code which will be executed</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
