INSERT INTO ezcontentobject_attribute VALUES (171,'eng-GB',1,69,127,'Creating workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (172,'eng-GB',1,69,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Workflows consist of a sequence of workflow events which will be executed one by one. Therefore, the first step is to create workflow event types. Alternatively, you can use events that already exist. </paragraph>\n  <section>\n    <header>Creating new workflow event</header>\n    <paragraph>Suppose that you want to create a workflow event which will show a &quot;hello user&quot; message to users after the workflow has run. We use hellouser as the name of the event. To create this new workflow event, you need to complete the following steps: </paragraph>\n    <paragraph>\n      <line>modify site.ini settings to add the new workflow event type. You should add &quot;event_hellouser&quot; to the AvailableEventTypes parameter</line>\n      <line>create directory kernel/classes/workflowtypes/event/hellouser/</line>\n      <line>create file in that directory called hellousertype.php</line>\n      <literal>\nFile: hellousertype.php\n \ndefine( &quot;EZ_WORKFLOW_TYPE_HELLO_USER_ID&quot;, &quot;hellouser&quot; );\n\nclass helloUserType extends eZWorkflowEventType\n{\n    /*!\n     Constructor\n    */\n    function helloUserType()\n    {\n        $this-&gt;eZWorkflowEventType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;Hello User&quot; );\n    }\n\n    function execute( &amp;$process, &amp;$event )\n    {\n        return EZ_WORKFLOW_TYPE_STATUS_ACCEPTED;\n    }\n}\n\neZWorkflowEventType::registerType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;hellousertype&quot; );\n</literal>\n    </paragraph>\n    <paragraph>This is a very simple workflow event type. To create a workflow event type we need to create a class inherited from eZWorkflowEventType and then register it into the system using the method eZWorkflowEventType::registerType(). This class should have at least one method in addition to the class constructor. The method execute is called when the workflow event is executed. The behaviour of running the workflow depends on the return value of this function. </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (171,'eng-GB',2,69,127,'Creating workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (172,'eng-GB',2,69,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Workflows consist of a sequence of workflow events which will be executed one by one. Therefore, the first step is to create workflow event types. Alternatively, you can use events that already exist.</paragraph>\n  <section>\n    <header>Creating new workflow event</header>\n    <paragraph>Suppose that you want to create a workflow event which will show a &quot;hello user&quot; message to users after the workflow has run. We use hellouser as the name of the event. To create this new workflow event, you need to complete the following steps:</paragraph>\n    <paragraph>\n      <line>modify site.ini settings to add the new workflow event type. You should add &quot;event_hellouser&quot; to the AvailableEventTypes parameter</line>\n      <line>create directory kernel/classes/workflowtypes/event/hellouser/</line>\n      <line>create file in that directory called hellousertype.php</line>\n      <literal>\nFile: hellousertype.php\n \ndefine( &quot;EZ_WORKFLOW_TYPE_HELLO_USER_ID&quot;, &quot;hellouser&quot; );\n\nclass helloUserType extends eZWorkflowEventType\n{\n    /*!\n     Constructor\n    */\n    function helloUserType()\n    {\n        $this-&gt;eZWorkflowEventType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;Hello User&quot; );\n    }\n\n    function execute( &amp;$process, &amp;$event )\n    {\n        return EZ_WORKFLOW_TYPE_STATUS_ACCEPTED;\n    }\n}\n\neZWorkflowEventType::registerType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;hellousertype&quot; );\n</literal>\n    </paragraph>\n    <paragraph>This is a very simple workflow event type. To create a workflow event type we need to create a class inherited from eZWorkflowEventType and then register it into the system using the method eZWorkflowEventType::registerType(). This class should have at least one method in addition to the class constructor. The method execute is called when the workflow event is executed. The behaviour of running the workflow depends on the return value of this function.</paragraph>\n    <paragraph>\n      <table border=\"0\">\n        <tr>\n          <td>\n            <paragraph>\n              <line>\n                <strong>Value</strong>\n              </line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>\n                <strong>Description</strong>\n              </line>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_ACCEPTED </line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>Workflow accepts that event, and run next event in workflow </line>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REJECTED</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_WORKFLOW_CANCELLED </line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>They have the same meaning currently. The workflow will be canceled.</line>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>This status means that execution of the workflow is deferred to the cron daemon. The difference between the first one and the second one is that the workflow will be executed from the next event in the first case and from the same event in the second case after finishing current running process. </line>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>The workflow engine should interrupt executing workflow and show page to the user. In case of this status, the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous case. </line>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>Workflow engine should interrupt executing the workflow and redirect the user to a specified page. In case of this status the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous cases. </line>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_NONE </line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <line>Undefined status. The same as EZ_WORKFLOW_TYPE_STATUS_REJECTED temporally. </line>\n            </paragraph>\n          </td>\n        </tr>\n      </table>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (167,'eng-GB',5,68,124,'Custom workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (168,'eng-GB',5,68,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>One of the most powerful features of eZ publish 3 is that you can create custom workflows. Workflow is a mechanism that makes it possible to customize or add new features to operations in eZ Publish. For example: add some additional actions to publish routing or some additional steps to view objects.</paragraph>\n  <paragraph>Workflows should be connected to defined eZ Publish operations with triggers (there are only two defined operations in the content module currently: &quot;Read&quot; and &quot;Publish&quot;). For each defined operation, the eZ Publish kernel tries to execute two triggers. One is activated before the actual operation body is executed and another is activated after that. A trigger is just a row stored in the database table eztrigger.</paragraph>\n  <paragraph>\n    <literal>\nTable definition:\n\nCREATE TABLE eztrigger (\n  id int(11) NOT NULL auto_increment,\n  name varchar(255),\n  module_name varchar(200) NOT NULL default &apos;&apos;,\n  function_name varchar(200) NOT NULL default &apos;&apos;,\n  workflow_id int(11) default NULL,\n  PRIMARY KEY  (id),\n  UNIQUE KEY eztrigger_def_id (module_name,function_name,name)\n) TYPE=MyISAM;\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>Field &quot;name&quot; is the name of the trigger, for example, &quot;pre_publish&quot; or &quot;pre_read&quot;. The fields module_name and function_name are the names of module and function that the system will start executing the workflow for.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (169,'eng-GB',5,68,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Understanding Operations</header>\n    <paragraph>An operation is a sequence of functions and triggers which should be executed to make a full action like read or publish. For example, simple &quot;read&quot; operation (below) is just a sequence of &quot;pre_read&quot; trigger and &quot;fetch-object&quot; method.</paragraph>\n    <paragraph>\n      <literal>\n$OperationList[&apos;read&apos;] = array( &apos;name&apos; =&gt; &apos;read&apos;,\n                                &apos;default_call_method&apos; =&gt; array( &apos;include_file&apos; =&gt; &apos;kernel/content/ezcontentoperationcollection.php&apos;,\n                                                                &apos;class&apos; =&gt; &apos;eZContentOperationCollection&apos; ),\n                                &apos;parameters&apos; =&gt; array( array( &apos;name&apos; =&gt; &apos;node_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;user_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;language_code&apos;,\n                                                              &apos;default&apos; =&gt; &apos;&apos;,\n                                                              &apos;required&apos; =&gt; false ) ),\n                                &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                 &apos;user_id&apos; ),\n\n                                &apos;body&apos; =&gt; array( array( &apos;type&apos; =&gt; &apos;trigger&apos;,\n                                                        &apos;name&apos; =&gt; &apos;pre_read&apos;,\n                                                        &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                                         &apos;user_id&apos;\n                                                                         ) ),\n\n                                                 array( &apos;type&apos; =&gt; &apos;method&apos;,\n                                                        &apos;name&apos; =&gt; &apos;fetch-object&apos;,\n                                                        &apos;frequency&apos; =&gt; &apos;once&apos;,\n                                                        &apos;method&apos; =&gt; &apos;readObject&apos;,\n                                                        ) ) );\n\n </literal>\n    </paragraph>\n    <paragraph>\n      <ul>\n        <li>\n          <line>name - the name of the operation.</line>\n          <line>default_call_method - an array which shows in which file and class methods used in the operation are defined</line>\n        </li>\n        <li>parameters - parameters that are passed to each method and trigger in the operation when they are executed</li>\n        <li>keys - part of parameters that are used to identify stored interrupted operation (operation memento)</li>\n        <li>body - array of arrays that describe methods and triggers of the operation</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <strong>Types of body elements</strong>\n    </paragraph>\n    <paragraph>\n      <line>Trigger: </line>\n      <ul>\n        <li>type - trigger, shows that current body element is trigger</li>\n        <li>name - name of the trigger used to fetch trigger from database. To fetch the trigger, the system will use next conditions - (module name, operation name, trigger name)</li>\n        <li>key - part of the parameters used to identify running workflow process</li>\n        <li />\n        <li>type - method</li>\n        <li>name - fetch-object, name of method used in internals of operation</li>\n        <li>frequency - once, it means that method will be run only once</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <line>method - method of class described with &quot;default_call_method&quot; &quot;class&quot; parameter of operation. That function is the code which will be executed</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (170,'eng-GB',5,68,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (171,'eng-GB',3,69,127,'Creating workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (172,'eng-GB',3,69,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Workflows consist of a sequence of workflow events which will be executed one by one. Therefore, the first step is to create workflow event types. Alternatively, you can use events that already exist.</paragraph>\n  <section>\n    <header>Creating new workflow event</header>\n    <paragraph>Suppose that you want to create a workflow event which will show a &quot;hello user&quot; message to users after the workflow has run. We use hellouser as the name of the event. To create this new workflow event, you need to complete the following steps:</paragraph>\n    <paragraph>\n      <line>modify site.ini settings to add the new workflow event type. You should add &quot;event_hellouser&quot; to the AvailableEventTypes parameter</line>\n      <line>create directory kernel/classes/workflowtypes/event/hellouser/</line>\n      <line>create file in that directory called hellousertype.php</line>\n      <literal>\nFile: hellousertype.php\n \ndefine( &quot;EZ_WORKFLOW_TYPE_HELLO_USER_ID&quot;, &quot;hellouser&quot; );\n\nclass helloUserType extends eZWorkflowEventType\n{\n    /*!\n     Constructor\n    */\n    function helloUserType()\n    {\n        $this-&gt;eZWorkflowEventType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;Hello User&quot; );\n    }\n\n    function execute( &amp;$process, &amp;$event )\n    {\n        return EZ_WORKFLOW_TYPE_STATUS_ACCEPTED;\n    }\n}\n\neZWorkflowEventType::registerType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;hellousertype&quot; );\n</literal>\n    </paragraph>\n    <paragraph>This is a very simple workflow event type. To create a workflow event type we need to create a class inherited from eZWorkflowEventType and then register it into the system using the method eZWorkflowEventType::registerType(). This class should have at least one method in addition to the class constructor. The method execute is called when the workflow event is executed. The behaviour of running the workflow depends on the return value of this function.</paragraph>\n    <paragraph>\n      <table border=\"1\"\n             width=\"100%\">\n        <tr>\n          <td>\n            <paragraph>\n              <strong>Value</strong>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <strong>Description</strong>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>EZ_WORKFLOW_TYPE_STATUS_ACCEPTED</paragraph>\n          </td>\n          <td>\n            <paragraph>Workflow accepts that event, and run next event in workflow</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REJECTED</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_WORKFLOW_CANCELLED</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>They have the same meaning currently. The workflow will be canceled.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>This status means that execution of the workflow is deferred to the cron daemon. The difference between the first one and the second one is that the workflow will be executed from the next event in the first case and from the same event in the second case after finishing current running process.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>The workflow engine should interrupt executing workflow and show page to the user. In case of this status, the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous case.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>Workflow engine should interrupt executing the workflow and redirect the user to a specified page. In case of this status the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous cases.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>EZ_WORKFLOW_TYPE_STATUS_NONE</paragraph>\n          </td>\n          <td>\n            <paragraph>Undefined status. The same as EZ_WORKFLOW_TYPE_STATUS_REJECTED temporally.</paragraph>\n          </td>\n        </tr>\n      </table>\n    </paragraph>\n    <paragraph>\n      <line>To show a page to the user, you need to use the status EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE and set up some internal variables. </line>\n      <literal>\n    function execute( &amp;$process, &amp;$event )\n    {\n\n        $user =&amp; eZUser::currentUser();\n        $userName =&amp; $user-&gt;attribute( &apos;login&apos; );\n        $localhostAddr = eZSys::hostname();\n        $requestUri = eZSys::serverVariable( &apos;REQUEST_URI&apos; );\n\n        $process-&gt;Template = array( &apos;templateName&apos; =&gt; &apos;design:workflow/eventtype/result/&apos; . &apos;event_hellouser&apos; . &apos;.tpl&apos;,\n                                     &apos;templateVars&apos; =&gt; array( &apos;return_uri&apos; =&gt; $requestUri,\n                                                              &apos;user_name&apos; =&gt; $userName ) );\n        return EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE;\n    }\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>In addition, you need to create the result template. </line>\n      <literal>\n&lt;form action={$return_uri|ezurl} method=&quot;post&quot; &gt;\n\n&lt;div class=&quot;maincontentheader&quot;&gt;\n&lt;h1&gt;{&quot;Hello&quot;|i18n(&apos;workflow/eventtype/result/event_hellouser&apos;)} {$user_name}&lt;/h1&gt;\n&lt;/div&gt;\n&lt;div class=&quot;buttonblock&quot;&gt;\n&lt;input type=&quot;submit&quot; name=&quot;Next&quot; value=&quot;next&quot; /&gt;\n&lt;/div&gt;\n&lt;/form&gt;\n</literal>\n    </paragraph>\n    <paragraph>The workflow event is ready now and it is time to create the workflow. Click on &apos;Workflows&apos; in the left menu and choose a defined group or just create a new one.</paragraph>\n    <paragraph>\n      <object id=\"70\" />\n    </paragraph>\n    <paragraph>then click &quot;New workflow&quot; button.</paragraph>\n    <paragraph>\n      <object id=\"71\" />Specify the workflow name first, and then you can add the &quot;Event/Hello User&quot; event to the workflow by selecting it from the dropdown list and clicking the &quot;New Event&quot; button.</paragraph>\n    <paragraph>\n      <object id=\"72\" />\n    </paragraph>\n    <paragraph>Simply click the store button after you have added the event.</paragraph>\n    <paragraph>Now the workflow is ready and you need to create a trigger. Go to the &quot;Triggers&quot; list (in the &quot;Set up&quot; menu box) and select the newly created workflow from the dropdown list on the content - read - before line.</paragraph>\n    <paragraph>\n      <object id=\"73\" />Click the &quot;Store&quot; button. The workflow is connected to the operation now. </paragraph>\n    <paragraph>Finally the workflow is ready and has been connected to the operation.</paragraph>\n  </section>\n</section>',1045487555,0);
