INSERT INTO ezcontentobject_attribute VALUES (186,'eng-GB',3,74,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Allows you to ask the user, before he confirms the order, if he wants to pack his goods into Christmas paper.</paragraph>\n  <paragraph>\n    <line>To create this workflow you need to do the following steps </line>\n    <line>Create new event_type</line>\n    <line>Create workflow with that event</line>\n    <line>Connect that workflow to the shop/confirm operation</line>\n  </paragraph>\n  <paragraph>\n    <line>To know how to create event type read the tutorial Custom workflows, go to the part called       \n      <link id=\"2\">&quot;Creating workflows&quot;</link>.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (187,'eng-GB',3,74,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Create a skeleton of a workflow event.</paragraph>\n  <paragraph>\n    <literal>\nFile ezwrappingtype.php:\n\ndefine( &quot;EZ_WORKFLOW_TYPE_WRAPPING_ID&quot;, &quot;ezwrapping&quot; );\n\nclass eZWrappingType extends eZWorkflowEventType\n{\n    /*!\n     Constructor\n    */\n    function eZWrappingType()\n    {\n        $this-&gt;eZWorkflowEventType( EZ_WORKFLOW_TYPE_WRAPPING_ID, &quot;Wrapping&quot; );\n    }\n    function execute( &amp;$process, &amp;$event )\n    {\n        return EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE_REPEAT;\n    }\n\n}\n\neZWorkflowEventType::registerType( EZ_WORKFLOW_TYPE_WRAPPING_ID, &quot;ezwrappingtype&quot; );\n</literal>\n  </paragraph>\n  <paragraph>We will modify the &quot;execute&quot; function to improve the functionality of the workflow.</paragraph>\n  <paragraph>\n    <literal>\n    function execute( &amp;$process, &amp;$event )\n    {\n        $http =&amp; eZHTTPTool::instance();\n\n        if ( $http-&gt;hasPostVariable( &quot;Next&quot; ) )\n        {\n            if ( $http-&gt;hasPostVariable( &quot;answer&quot; ) )\n            {\n                $answer = $http-&gt;postVariable( &quot;answer&quot; );\n                eZDebug::writeDebug( &apos;got answer&apos; );\n               if( $answer == &apos;yes&apos; )\n               {\n                   $parameters = $process-&gt;attribute( &apos;parameter_list&apos; );\n                   eZDebug::writeDebug( &apos;got yes&apos; );\n                   $orderID = $parameters[&apos;order_id&apos;];\n\n                   $orderItem = new eZOrderItem( array( &apos;order_id&apos; =&gt; $orderID,\n                                                        &apos;description&apos; =&gt; &apos;Wrapping&apos;,\n                                                        &apos;price&apos; =&gt; &apos;100&apos;,\n                                                        &apos;vat_is_included&apos; =&gt; true,\n                                                        &apos;vat_type_id&apos; =&gt; 1 )\n                                                 );\n                   $orderItem-&gt;store();\n\n               }else\n               {\n                   eZDebug::writeDebug( &apos;got no&apos; );\n\n               }\n               return EZ_WORKFLOW_TYPE_STATUS_ACCEPTED;\n           }\n       }\n       $requestUri = eZSys::requestUri();\n       $process-&gt;Template = array( &apos;templateName&apos; =&gt; &apos;design:workflow/eventtype/result/&apos; . &apos;event_ezwrapping&apos; . &apos;.tpl&apos;,\n                                   &apos;templateVars&apos; =&gt; array( &apos;request_uri&apos; =&gt; $requestUri )\n                                    );\n       return EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE_REPEAT;\n     }\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>line 2 - get eZHTTPTool instance to fetch postvariable from.</line>\n    <line> Conditional operators (4-6) which check if the needed http variables exist. This is needed to check whether this is the answer from the user.</line>\n    <line> If we get an answer from user and if answer is yes we need to create an order item with wrapping.</line>\n    <line> OrderID is a workflow parameter (defined by operation) so you can fetch it from parameters list (12,14)</line>\n    <line> If the answer is &quot;no&quot; we &quot;accept&quot; event.</line>\n    <line> When the event runs first we need to say to the system that we need to halt an operation and show an additional page to the user (32-36)</line>\n  </paragraph>\n</section>',1045487555,0);
