INSERT INTO ezcontentobject_attribute VALUES (194,'eng-GB',1,77,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <literal>\n&lt;form action={$return_uri|ezurl} method=&quot;post&quot; &gt;\n\n&lt;div class=&quot;maincontentheader&quot;&gt;\n&lt;h1&gt;{&quot;Hello&quot;|i18n(&apos;workflow/eventtype/result/event_hellouser&apos;)} {$user_name}&lt;/h1&gt;\n&lt;/div&gt;\n&lt;div class=&quot;buttonblock&quot;&gt;\n&lt;input type=&quot;submit&quot; name=&quot;Next&quot; value=&quot;next&quot; /&gt;\n&lt;/div&gt;\n\n&lt;/form&gt;\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>The page will look like this:</line>\n    <object id=\"78\" />\n  </paragraph>\n</section>',1045487555,0);
