INSERT INTO ezcontentobject_attribute VALUES (199,'eng-GB',1,79,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>To know how to connect the workflow to the operation look through the Approval workflow tutorial. When connecting to the operation (triggers) select the name of the created workflow in the front of &quot;shop-confirm-before&quot;.</paragraph>\n  <paragraph>\n    <object id=\"80\" />\n  </paragraph>\n</section>',1045487555,0);
