INSERT INTO ezcontentobject_attribute VALUES (168,'eng-GB',7,68,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>One of the most powerful features of eZ publish 3 is that you can create custom workflows. Workflow is a mechanism that makes it possible to customize or add new features to operations in eZ Publish. For example: add some additional actions to publish routing or some additional steps to view objects.</paragraph>\n  <paragraph>Workflows should be connected to defined eZ Publish operations with triggers (there are only two defined operations in the content module currently: &quot;Read&quot; and &quot;Publish&quot;). For each defined operation, the eZ Publish kernel tries to execute two triggers. One is activated before the actual operation body is executed and another is activated after that. A trigger is just a row stored in the database table eztrigger.</paragraph>\n  <paragraph>\n    <literal>\nTable definition:\n\nCREATE TABLE eztrigger (\n  id int(11) NOT NULL auto_increment,\n  name varchar(255),\n  module_name varchar(200) NOT NULL default &apos;&apos;,\n  function_name varchar(200) NOT NULL default &apos;&apos;,\n  workflow_id int(11) default NULL,\n  PRIMARY KEY  (id),\n  UNIQUE KEY eztrigger_def_id (module_name,function_name,name)\n) TYPE=MyISAM;\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>Field &quot;name&quot; is the name of the trigger, for example, &quot;pre_publish&quot; or &quot;pre_read&quot;. The fields module_name and function_name are the names of module and function that the system will start executing the workflow for.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (169,'eng-GB',7,68,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Understanding Operations</header>\n    <paragraph>An operation is a sequence of functions and triggers which should be executed to make a full action like read or publish. For example, simple &quot;read&quot; operation (below) is just a sequence of &quot;pre_read&quot; trigger and &quot;fetch-object&quot; method.</paragraph>\n    <paragraph>\n      <literal>\n$OperationList[&apos;read&apos;] = array( &apos;name&apos; =&gt; &apos;read&apos;,\n                                &apos;default_call_method&apos; =&gt; array( &apos;include_file&apos; =&gt; &apos;kernel/content/ezcontentoperationcollection.php&apos;,\n                                                                &apos;class&apos; =&gt; &apos;eZContentOperationCollection&apos; ),\n                                &apos;parameters&apos; =&gt; array( array( &apos;name&apos; =&gt; &apos;node_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;user_id&apos;,\n                                                              &apos;required&apos; =&gt; true ),\n                                                       array( &apos;name&apos; =&gt; &apos;language_code&apos;,\n                                                              &apos;default&apos; =&gt; &apos;&apos;,\n                                                              &apos;required&apos; =&gt; false ) ),\n                                &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                 &apos;user_id&apos; ),\n\n                                &apos;body&apos; =&gt; array( array( &apos;type&apos; =&gt; &apos;trigger&apos;,\n                                                        &apos;name&apos; =&gt; &apos;pre_read&apos;,\n                                                        &apos;keys&apos; =&gt; array( &apos;node_id&apos;,\n                                                                         &apos;user_id&apos;\n                                                                         ) ),\n\n                                                 array( &apos;type&apos; =&gt; &apos;method&apos;,\n                                                        &apos;name&apos; =&gt; &apos;fetch-object&apos;,\n                                                        &apos;frequency&apos; =&gt; &apos;once&apos;,\n                                                        &apos;method&apos; =&gt; &apos;readObject&apos;,\n                                                        ) ) );\n\n </literal>\n    </paragraph>\n    <paragraph>\n      <ul>\n        <li>\n          <line>name - the name of the operation.</line>\n          <line>default_call_method - an array which shows in which file and class methods used in the operation are defined</line>\n        </li>\n        <li>parameters - parameters that are passed to each method and trigger in the operation when they are executed</li>\n        <li>keys - part of parameters that are used to identify stored interrupted operation (operation memento)</li>\n        <li>body - array of arrays that describe methods and triggers of the operation</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <strong>Types of body elements</strong>\n    </paragraph>\n    <paragraph>\n      <line>Trigger: </line>\n      <ul>\n        <li>type - trigger, shows that current body element is trigger</li>\n        <li>name - name of the trigger used to fetch trigger from database. To fetch the trigger, the system will use next conditions - (module name, operation name, trigger name)</li>\n        <li>key - part of the parameters used to identify running workflow process</li>\n      </ul>\n    </paragraph>\n    <paragraph>\n      <line>Method: </line>\n      <ul>\n        <li>type - method</li>\n        <li>name - fetch-object, name of method used in internals of operation</li>\n        <li>frequency - once, it means that method will be run only once</li>\n        <li>method - method of class described with &quot;default_call_method&quot; &quot;class&quot; parameter of operation. That function is the code which will be executed</li>\n      </ul>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
