INSERT INTO ezcontentobject_attribute VALUES (171,'eng-GB',4,69,127,'Creating workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (172,'eng-GB',4,69,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Workflows consist of a sequence of workflow events which will be executed one by one. Therefore, the first step is to create workflow event types. Alternatively, you can use events that already exist.</paragraph>\n  <section>\n    <header>Creating new workflow event</header>\n    <paragraph>Suppose that you want to create a workflow event which will show a &quot;hello user&quot; message to users after the workflow has run. We use hellouser as the name of the event. To create this new workflow event, you need to complete the following steps:</paragraph>\n    <paragraph>\n      <ol>\n        <li>\n          <line>modify site.ini settings to add the new workflow event type.</line>\n          <line>You should add &quot;event_hellouser&quot; to the AvailableEventTypes parameter</line>\n        </li>\n        <li>create directory kernel/classes/workflowtypes/event/hellouser/</li>\n        <li>create file in that directory called hellousertype.php</li>\n      </ol>\n    </paragraph>\n    <paragraph>\n      <literal>\nFile: hellousertype.php\n \ndefine( &quot;EZ_WORKFLOW_TYPE_HELLO_USER_ID&quot;, &quot;hellouser&quot; );\n\nclass helloUserType extends eZWorkflowEventType\n{\n    /*!\n     Constructor\n    */\n    function helloUserType()\n    {\n        $this-&gt;eZWorkflowEventType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;Hello User&quot; );\n    }\n\n    function execute( &amp;$process, &amp;$event )\n    {\n        return EZ_WORKFLOW_TYPE_STATUS_ACCEPTED;\n    }\n}\n\neZWorkflowEventType::registerType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;hellousertype&quot; );\n</literal>\n    </paragraph>\n    <paragraph>This is a very simple workflow event type. To create a workflow event type we need to create a class inherited from eZWorkflowEventType and then register it into the system using the method eZWorkflowEventType::registerType(). This class should have at least one method in addition to the class constructor. The method execute is called when the workflow event is executed. The behaviour of running the workflow depends on the return value of this function.</paragraph>\n    <paragraph>\n      <table border=\"1\"\n             width=\"100%\">\n        <tr>\n          <td>\n            <paragraph>\n              <strong>Value</strong>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <strong>Description</strong>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>EZ_WORKFLOW_TYPE_STATUS_ACCEPTED</paragraph>\n          </td>\n          <td>\n            <paragraph>Workflow accepts that event, and run next event in workflow</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REJECTED</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_WORKFLOW_CANCELLED</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>They have the same meaning currently. The workflow will be canceled.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>This status means that execution of the workflow is deferred to the cron daemon. The difference between the first one and the second one is that the workflow will be executed from the next event in the first case and from the same event in the second case after finishing current running process.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>The workflow engine should interrupt executing workflow and show page to the user. In case of this status, the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous case.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>Workflow engine should interrupt executing the workflow and redirect the user to a specified page. In case of this status the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous cases.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>EZ_WORKFLOW_TYPE_STATUS_NONE</paragraph>\n          </td>\n          <td>\n            <paragraph>Undefined status. The same as EZ_WORKFLOW_TYPE_STATUS_REJECTED temporally.</paragraph>\n          </td>\n        </tr>\n      </table>\n    </paragraph>\n    <paragraph>\n      <line>To show a page to the user, you need to use the status EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE and set up some internal variables. </line>\n      <literal>\n    function execute( &amp;$process, &amp;$event )\n    {\n\n        $user =&amp; eZUser::currentUser();\n        $userName =&amp; $user-&gt;attribute( &apos;login&apos; );\n        $localhostAddr = eZSys::hostname();\n        $requestUri = eZSys::serverVariable( &apos;REQUEST_URI&apos; );\n\n        $process-&gt;Template = array( &apos;templateName&apos; =&gt; &apos;design:workflow/eventtype/result/&apos; . &apos;event_hellouser&apos; . &apos;.tpl&apos;,\n                                     &apos;templateVars&apos; =&gt; array( &apos;return_uri&apos; =&gt; $requestUri,\n                                                              &apos;user_name&apos; =&gt; $userName ) );\n        return EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE;\n    }\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>In addition, you need to create the result template. </line>\n      <literal>\n&lt;form action={$return_uri|ezurl} method=&quot;post&quot; &gt;\n\n&lt;div class=&quot;maincontentheader&quot;&gt;\n&lt;h1&gt;{&quot;Hello&quot;|i18n(&apos;workflow/eventtype/result/event_hellouser&apos;)} {$user_name}&lt;/h1&gt;\n&lt;/div&gt;\n&lt;div class=&quot;buttonblock&quot;&gt;\n&lt;input type=&quot;submit&quot; name=&quot;Next&quot; value=&quot;next&quot; /&gt;\n&lt;/div&gt;\n&lt;/form&gt;\n</literal>\n    </paragraph>\n    <paragraph>The workflow event is ready now and it is time to create the workflow. Click on &apos;Workflows&apos; in the left menu and choose a defined group or just create a new one.</paragraph>\n    <paragraph>\n      <object id=\"70\" />\n    </paragraph>\n    <paragraph>then click &quot;New workflow&quot; button.</paragraph>\n    <paragraph>\n      <object id=\"71\" />Specify the workflow name first, and then you can add the &quot;Event/Hello User&quot; event to the workflow by selecting it from the dropdown list and clicking the &quot;New Event&quot; button.</paragraph>\n    <paragraph>\n      <object id=\"72\" />\n    </paragraph>\n    <paragraph>Simply click the store button after you have added the event.</paragraph>\n    <paragraph>Now the workflow is ready and you need to create a trigger. Go to the &quot;Triggers&quot; list (in the &quot;Set up&quot; menu box) and select the newly created workflow from the dropdown list on the content - read - before line.</paragraph>\n    <paragraph>\n      <object id=\"73\" />Click the &quot;Store&quot; button. The workflow is connected to the operation now.</paragraph>\n    <paragraph>\n      <line>Finally the workflow is ready and has been connected to the operation.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (171,'eng-GB',5,69,127,'Creating workflows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (172,'eng-GB',5,69,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Workflows consist of a sequence of workflow events which will be executed one by one. Therefore, the first step is to create workflow event types. Alternatively, you can use events that already exist.</paragraph>\n  <section>\n    <header>Creating new workflow event</header>\n    <paragraph>Suppose that you want to create a workflow event which will show a &quot;hello user&quot; message to users after the workflow has run. We use hellouser as the name of the event. To create this new workflow event, you need to complete the following steps:</paragraph>\n    <paragraph>\n      <ol>\n        <li>\n          <line>modify site.ini settings to add the new workflow event type. You should add &quot;event_hellouser&quot; to the AvailableEventTypes parameter</line>\n        </li>\n        <li>create directory kernel/classes/workflowtypes/event/hellouser/</li>\n        <li>create file in that directory called hellousertype.php</li>\n      </ol>\n    </paragraph>\n    <paragraph>\n      <literal>\nFile: hellousertype.php\n \ndefine( &quot;EZ_WORKFLOW_TYPE_HELLO_USER_ID&quot;, &quot;hellouser&quot; );\n\nclass helloUserType extends eZWorkflowEventType\n{\n    /*!\n     Constructor\n    */\n    function helloUserType()\n    {\n        $this-&gt;eZWorkflowEventType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;Hello User&quot; );\n    }\n\n    function execute( &amp;$process, &amp;$event )\n    {\n        return EZ_WORKFLOW_TYPE_STATUS_ACCEPTED;\n    }\n}\n\neZWorkflowEventType::registerType( EZ_WORKFLOW_TYPE_HELLO_USER_ID, &quot;hellousertype&quot; );\n</literal>\n    </paragraph>\n    <paragraph>This is a very simple workflow event type. To create a workflow event type we need to create a class inherited from eZWorkflowEventType and then register it into the system using the method eZWorkflowEventType::registerType(). This class should have at least one method in addition to the class constructor. The method execute is called when the workflow event is executed. The behaviour of running the workflow depends on the return value of this function.</paragraph>\n    <paragraph>\n      <table border=\"1\"\n             width=\"100%\">\n        <tr>\n          <td>\n            <paragraph>\n              <strong>Value</strong>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>\n              <strong>Description</strong>\n            </paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>EZ_WORKFLOW_TYPE_STATUS_ACCEPTED</paragraph>\n          </td>\n          <td>\n            <paragraph>Workflow accepts that event, and run next event in workflow</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REJECTED</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_WORKFLOW_CANCELLED</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>They have the same meaning currently. The workflow will be canceled.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_DEFERRED_TO_CRON_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>This status means that execution of the workflow is deferred to the cron daemon. The difference between the first one and the second one is that the workflow will be executed from the next event in the first case and from the same event in the second case after finishing current running process.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>The workflow engine should interrupt executing workflow and show page to the user. In case of this status, the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous case.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT</line>\n              <line>EZ_WORKFLOW_TYPE_STATUS_REDIRECT_REPEAT</line>\n            </paragraph>\n          </td>\n          <td>\n            <paragraph>Workflow engine should interrupt executing the workflow and redirect the user to a specified page. In case of this status the workflow event should set up some internal variables. (Will be explaned below). Differences between them is the same as in the previous cases.</paragraph>\n          </td>\n        </tr>\n        <tr>\n          <td>\n            <paragraph>EZ_WORKFLOW_TYPE_STATUS_NONE</paragraph>\n          </td>\n          <td>\n            <paragraph>Undefined status. The same as EZ_WORKFLOW_TYPE_STATUS_REJECTED temporally.</paragraph>\n          </td>\n        </tr>\n      </table>\n    </paragraph>\n    <paragraph>\n      <line>To show a page to the user, you need to use the status EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE and set up some internal variables. </line>\n      <literal>\n    function execute( &amp;$process, &amp;$event )\n    {\n\n        $user =&amp; eZUser::currentUser();\n        $userName =&amp; $user-&gt;attribute( &apos;login&apos; );\n        $localhostAddr = eZSys::hostname();\n        $requestUri = eZSys::serverVariable( &apos;REQUEST_URI&apos; );\n\n        $process-&gt;Template = array( &apos;templateName&apos; =&gt; &apos;design:workflow/eventtype/result/&apos; . &apos;event_hellouser&apos; . &apos;.tpl&apos;,\n                                     &apos;templateVars&apos; =&gt; array( &apos;return_uri&apos; =&gt; $requestUri,\n                                                              &apos;user_name&apos; =&gt; $userName ) );\n        return EZ_WORKFLOW_TYPE_STATUS_FETCH_TEMPLATE;\n    }\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>In addition, you need to create the result template. </line>\n      <literal>\n&lt;form action={$return_uri|ezurl} method=&quot;post&quot; &gt;\n\n&lt;div class=&quot;maincontentheader&quot;&gt;\n&lt;h1&gt;{&quot;Hello&quot;|i18n(&apos;workflow/eventtype/result/event_hellouser&apos;)} {$user_name}&lt;/h1&gt;\n&lt;/div&gt;\n&lt;div class=&quot;buttonblock&quot;&gt;\n&lt;input type=&quot;submit&quot; name=&quot;Next&quot; value=&quot;next&quot; /&gt;\n&lt;/div&gt;\n&lt;/form&gt;\n</literal>\n    </paragraph>\n    <paragraph>The workflow event is ready now and it is time to create the workflow. Click on &apos;Workflows&apos; in the left menu and choose a defined group or just create a new one.</paragraph>\n    <paragraph>\n      <object id=\"70\" />\n    </paragraph>\n    <paragraph>then click &quot;New workflow&quot; button.</paragraph>\n    <paragraph>\n      <object id=\"71\" />Specify the workflow name first, and then you can add the &quot;Event/Hello User&quot; event to the workflow by selecting it from the dropdown list and clicking the &quot;New Event&quot; button.</paragraph>\n    <paragraph>\n      <object id=\"72\" />\n    </paragraph>\n    <paragraph>Simply click the store button after you have added the event.</paragraph>\n    <paragraph>Now the workflow is ready and you need to create a trigger. Go to the &quot;Triggers&quot; list (in the &quot;Set up&quot; menu box) and select the newly created workflow from the dropdown list on the content - read - before line.</paragraph>\n    <paragraph>\n      <object id=\"73\" />Click the &quot;Store&quot; button. The workflow is connected to the operation now.</paragraph>\n    <paragraph>\n      <line>Finally the workflow is ready and has been connected to the operation.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (198,'eng-GB',2,79,127,'Creating and connecting the workflow ',0,0);
INSERT INTO ezcontentobject_attribute VALUES (199,'eng-GB',2,79,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>To know how to connect the workflow to the operation look through the Approval workflow tutorial. When connecting to the operation (triggers) select the name of the created workflow in the front of &quot;shop-confirm-before&quot;.</paragraph>\n  <paragraph>\n    <object id=\"80\" />\n  </paragraph>\n  <paragraph>So now you can use the workflow. </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (203,'eng-GB',1,81,124,'Approval workflow',0,0);
INSERT INTO ezcontentobject_attribute VALUES (204,'eng-GB',1,81,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>One of the most powerful features of eZ publish 3 is that you can create custom workflows. Workflow is a mechanism implemented to give you the possibility to customize or add new features to operations in eZ Publish. eZ Publish 3 already has the workflow events needed to create a publishing approval workflow.</paragraph>\n  <paragraph>The workflow we will create will allow you to set up approval of object publishing in some places of your site, for certain user groups. It consists of an &quot;Approve&quot; event. The &quot;Approve&quot; event creates a collaboration item when it runs, the collaboration item will link the author and the approver together were they may discuss the content object and the approver will then decide what to do with it.</paragraph>\n  <paragraph>\n    <line>To set up an approval workflow you need to do next tree steps: </line>\n    <ul>\n      <li>Create the workflow</li>\n      <li>Setup workflow parameters</li>\n      <li>Connect the workflow to the operation</li>\n    </ul>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (205,'eng-GB',1,81,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Create the workflow</header>\n    <paragraph>To create the new workflow you need to get into one of the workflow groups and click &quot;New&quot; there. It will create a new workflow and redirect you to an edit page. There you should fill in the &quot;name&quot; text entry with the name of your workflow, something like &quot;Approval by editor&quot;, it is up to you. After that select Event/Approve from the drop down and click &quot;New&quot;. Now you have created the necessary workflow.</paragraph>\n    <paragraph>\n      <object id=\"82\" />\n    </paragraph>\n    <section>\n      <header>Setup workflow parameters</header>\n      <paragraph>To customize the approval workflow you need to choose the values for editor, sections, and user groups. Editor is the person to whom the system sends approval tasks. Sections are the sections in which the approval workflow takes effect (tasks will be created only if the object is published in one of the selected sections). Users without approval are the user groups whose users do not require approval when publishing objects. After setting up these parameters click the &quot;Store&quot; button</paragraph>\n    </section>\n  </section>\n  <section>\n    <header>Connect the workflow to the operation</header>\n    <paragraph>\n      <line>Go to the &quot;Triggers&quot; list and select the newly created workflow </line>\n      <line>from the dropdown list on the content - publish - before line.</line>\n    </paragraph>\n    <paragraph>\n      <object id=\"83\" />\n    </paragraph>\n    <paragraph>\n      <line>Click the &quot;Store&quot; button. Now the workflow is connected to the operation.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
