INSERT INTO ezcontentobject_attribute VALUES (204,'eng-GB',2,81,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>One of the most powerful features of eZ publish 3 is that you can create custom workflows. Workflow is a mechanism implemented to give you the possibility to customize or add new features to operations in eZ Publish. eZ Publish 3 already has the workflow events needed to create a publishing approval workflow.</paragraph>\n  <paragraph>The workflow we will create will allow you to set up approval of object publishing in some places of your site, for certain user groups. It consists of an &quot;Approve&quot; event. The &quot;Approve&quot; event creates a collaboration item when it runs, the collaboration item will link the author and the approver together were they may discuss the content object and the approver will then decide what to do with it.</paragraph>\n  <paragraph>\n    <line>To set up an approval workflow you need to do next tree steps: </line>\n    <ul>\n      <li>Create the workflow</li>\n      <li>Setup workflow parameters</li>\n      <li>Connect the workflow to the operation</li>\n    </ul>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (205,'eng-GB',2,81,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Create the workflow</header>\n    <paragraph>To create the new workflow you need to get into one of the workflow groups and click &quot;New&quot; there. It will create a new workflow and redirect you to an edit page. There you should fill in the &quot;name&quot; text entry with the name of your workflow, something like &quot;Approval by editor&quot;, it is up to you. After that select Event/Approve from the drop down and click &quot;New&quot;. Now you have created the necessary workflow.</paragraph>\n    <paragraph>\n      <object id=\"82\" />\n    </paragraph>\n    <section>\n      <header>Setup workflow parameters</header>\n      <paragraph>To customize the approval workflow you need to choose the values for editor, sections, and user groups. Editor is the person to whom the system sends approval tasks. Sections are the sections in which the approval workflow takes effect (tasks will be created only if the object is published in one of the selected sections). Users without approval are the user groups whose users do not require approval when publishing objects. After setting up these parameters click the &quot;Store&quot; button</paragraph>\n    </section>\n    <section>\n      <header>Connect the workflow to the operation</header>\n      <paragraph>\n        <line>Go to the &quot;Triggers&quot; list and select the newly created workflow </line>\n        <line>from the dropdown list on the content - publish - before line.</line>\n      </paragraph>\n      <paragraph>\n        <object id=\"83\" />\n      </paragraph>\n      <paragraph>\n        <line>Click the &quot;Store&quot; button. Now the workflow is connected to the operation.</line>\n      </paragraph>\n    </section>\n  </section>\n</section>',1045487555,0);
