INSERT INTO ezcontentobject_attribute VALUES (213,'eng-GB',1,84,124,'Datatypes in eZ publish 3',0,0);
INSERT INTO ezcontentobject_attribute VALUES (214,'eng-GB',1,84,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>Datatypes are the most useful building blocks in eZ publish 3. To create any attribute in any class, you need to choose a suitable datatype to represent your attribute. The concept of eZ publish datatypes is not exactly the same as datatypes in common programming languages although eZ publish has some basic datatypes such as integer, float and textline which is actually a string type. Datatypes in eZ publish are defined as fundamental and common elements which can build complex products on the Internet. </line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (215,'eng-GB',1,84,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Overview of available datatypes</header>\n    <paragraph>eZ publish 3 comes with the following fundamental datatypes. </paragraph>\n    <paragraph>\n      <ul>\n        <li>Text line</li>\n        <li>Integer</li>\n        <li>Float</li>\n        <li>Text field</li>\n        <li>XML Text field</li>\n        <li>User account</li>\n        <li>Image</li>\n        <li>Media</li>\n        <li>Check box</li>\n        <li>Enum</li>\n        <li>Option</li>\n        <li>Email</li>\n        <li>Author</li>\n        <li>Price</li>\n        <li>Date field</li>\n        <li>Time</li>\n        <li>Datetime</li>\n        <li>Object relation</li>\n        <li>ISBN</li>\n        <li>URL</li>\n        <li>BinaryFile</li>\n      </ul>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (216,'eng-GB',1,84,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (217,'eng-GB',1,85,127,'Creating a new datatype',0,0);
INSERT INTO ezcontentobject_attribute VALUES (218,'eng-GB',1,85,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>When you are creating or editing a class object, you should decide which datatypes are going to be used by your attributes. Although the datatypes that come with eZ publish are powerful enough for creating complex content classes, you might still need to create your own datatypes for specific cases. Creating new datatypes requires having some basic knowledge of how eZ publish datatypes work and which classes are necessary to be changed or added. In the following tutorial, how to create a new datatype is shown step by step using the datatype Email as an example. The Email datatype is used to save email address and implements some check rules to verify that input email is of correct format. </paragraph>\n  <paragraph>\n    <strong>Step 1: Build the file structure for your new datatype.</strong>\n  </paragraph>\n  <paragraph>To make the datatype Email, you should first create the folder ezemail under ./kernel/classes/datatypes/, then create the file called ezemailtype.php under the newly created folder. Note that the name of the folder and PHP file is important since it will be used to locate the file. The basic structure is that if you added a datatype x, it should be stored like this: ./kernel/classes/datatypes/ezx/ezxtype.php. </paragraph>\n  <paragraph>\n    <strong>Step 2: Write the datatype file inherited from file ./kernel/classes/ezdatatype.php.</strong>\n  </paragraph>\n  <paragraph> All datatype files should inherit from the file ./kernel/classes/ezdatatype.php and implement some functions which the super class has defined but not implemented. Let&apos;s work through the code of ezemailtype.php to see how this class was implemented. </paragraph>\n  <paragraph>\n    <literal>\n&lt;?php\n\n// Include the super class file\ninclude_once( &quot;kernel/classes/ezdatatype.php&quot; );\n\n// Include the file which will be used to validate email\ninclude_once( &quot;lib/ezutils/classes/ezmail.php&quot; );\n\n// Define the name of datatype string\ndefine( &quot;EZ_DATATYPESTRING_EMAIL&quot;, &quot;ezemail&quot; );\n\nclass eZEmailType extends eZDataType\n{\n    /*!\n     Construction of the class, note that the second parameter in eZDataType is the actual name\n     showed in the datatype dropdown list.\n    */\n    function eZEmailType( )\n    {\n        $this-&gt;eZDataType( EZ_DATATYPESTRING_EMAIL, &quot;Email&quot; );\n    }\n\n    /*!\n     Validates the input and returns true if the input was valid for this datatype. Here you could\n     add special rules for validating email.\n     Parameters $http holds the class object eZHttpTool which has functions to fetch and check http input.\n     Parameters $base holds the base name of http variable, in this case the base name will be &apos;ContentObjectAttribute&apos;.\n     Parameters $contentObjectAttribute holds the attribue object.\n    */\n    function validateObjectAttributeHTTPInput( &amp;$http, $base, &amp;$contentObjectAttribute )\n    {\n        if ( $http-&gt;hasPostVariable( $base . &apos;_data_text_&apos; . $contentObjectAttribute-&gt;attribute( &apos;id&apos; ) ) )\n        {\n            $email =&amp; $http-&gt;postVariable( $base . &apos;_data_text_&apos; . $contentObjectAttribute-&gt;attribute( &apos;id&apos; ) );\n            $classAttribute =&amp; $contentObjectAttribute-&gt;contentClassAttribute();\n            if( $classAttribute-&gt;attribute( &quot;is_required&quot; ) == true )\n            {\n                if( $email == &quot;&quot; )\n                {\n                    $contentObjectAttribute-&gt;setValidationError( ezi18n( &apos;content/datatypes&apos;,\n                                                                         &apos;A valid email account is required.&apos;,\n                                                                         &apos;eZEmailType&apos; ) );\n                    return EZ_INPUT_VALIDATOR_STATE_INVALID;\n                }\n            }\n            if( $email != &quot;&quot; )\n            {\n                $isValidate =  eZMail::validate( $email );\n                if ( ! $isValidate )\n                {\n                    $contentObjectAttribute-&gt;setValidationError( ezi18n( &apos;content/datatypes&apos;,\n                                                                         &apos;Email address is not valid.&apos;,\n                                                                         &apos;eZEmailType&apos; ) );\n                    return EZ_INPUT_VALIDATOR_STATE_INVALID;\n                }\n            }\n        }\n        return EZ_INPUT_VALIDATOR_STATE_ACCEPTED;\n    }\n\n    /*!\n     Fetches the http post var string input and stores it in the data instance.\n     An email could be easily stored as variable characters, we use data_text filed in database to save it.\n     In the template, the textfile name of email input is something like &apos;ContentObjectAttribute_data_text_idOfTheAttribute&apos;,\n     therefore we fetch the http variable &apos;$base . &quot;_data_text_&quot; . $contentObjectAttribute-&gt;attribute( &quot;id&quot; )&apos;.\n     Again, parameters $base holds the base name of http variable and is &apos;ContentObjectAttribute&apos; in this example.\n    */\n    function fetchObjectAttributeHTTPInput( &amp;$http, $base, &amp;$contentObjectAttribute )\n    {\n        if ( $http-&gt;hasPostVariable( $base . &quot;_data_text_&quot; . $contentObjectAttribute-&gt;attribute( &quot;id&quot; ) ) )\n        {\n            $data =&amp; $http-&gt;postVariable( $base . &quot;_data_text_&quot; . $contentObjectAttribute-&gt;attribute( &quot;id&quot; ) );\n            $contentObjectAttribute-&gt;setAttribute( &quot;data_text&quot;, $data );\n        }\n        return false;\n    }\n\n    /*!\n     Store the content. Since the content has been stored in function fetchObjectAttributeHTTPInput(),\n     this function is with empty code.\n    */\n    function storeObjectAttribute( &amp;$contentObjectattribute )\n    {\n    }\n\n    /*!\n     Returns the content.\n    */\n    function &amp;objectAttributeContent( &amp;$contentObjectAttribute )\n    {\n        return $contentObjectAttribute-&gt;attribute( &quot;data_text&quot; );\n    }\n\n    /*!\n     Returns the meta data used for storing search indices.\n    */\n    function metaData( $contentObjectAttribute )\n    {\n        return $contentObjectAttribute-&gt;attribute( &quot;data_text&quot; );\n    }\n\n    /*!\n     Returns the text.\n    */\n    function title( &amp;$contentObjectAttribute )\n    {\n        return  $contentObjectAttribute-&gt;attribute( &quot;data_text&quot; );\n    }\n}\neZDataType::register( EZ_DATATYPESTRING_EMAIL, &quot;ezemailtype&quot; );\n?&gt;\n}\n</literal>\n  </paragraph>\n  <paragraph>As the code illustrates, it must include the PHP file ezdatatype.php and inherit from eZDataType. The class should implement the functions validateObjectAttributeHTTPInput, fixupObjectAttributeHTTPInput, fetchObjectAttributeHTTPInput, and storeObjectAttribute. The function validateObjectAttributeHTTPInput, which validates the datatype input, and the function fetchObjectAttributeHTTPInput, which gets the datatype input and stores it, are the most important functions that need to be rewritten for every new datatype. Other functions may have the same content. At the end of the file, the new datatype should be registered in the system by calling the register method in the class eZDataType. </paragraph>\n  <paragraph>\n    <line>In this example, the following line</line>\n    <literal>\neZDataType::register( EZ_DATATYPESTRING_EMAIL, &quot;ezemailtype&quot; );\n</literal>\n  </paragraph>\n  <paragraph>was added.</paragraph>\n  <paragraph>\n    <strong>Step 3: Add associated template files for the content class.</strong>\n  </paragraph>\n  <paragraph>Not every datatype needs to have a template file in class level since most datatypes can use standard UI supplied with eZ publish. It is only necessary when the datatype has specific constraints that need to be defined during class editing. Examples are setting a default value for the datatype, adding customer action buttons, etc. If so, the datatype file should implement the functions storeClassAttribute, validateClassAttributeHTTPInput, fixupClassAttributeHTTPInput, and fetchClassAttributeHTTPInput which are defined in the super class ezdatatype.php. These functions deal with how to fetch and validate input and then store it in the database. Note that the template file should be located at ./design/standard/templates/class/datatype/edit/ezx.tpl. The datatype Email does not have a specification in class level and therefore nothing needs to be done in this case. </paragraph>\n  <paragraph>\n    <strong>Step 4: Add associated template files for content object.</strong>\n  </paragraph>\n  <paragraph>For every datatype, two template files must to be added. One template file for content object editing and one for content object viewing. In this example, we add one ezemail.tpl (shown below) under ./design/standard/templates/content/datatype/edit/. This is just a normal text field with corresponding name we defined in eZEmailtype.php. Users will use this text field to edit or input email address. </paragraph>\n  <paragraph>\n    <literal>\n&lt;input type=&quot;text&quot; size=&quot;10&quot; name=&quot;ContentObjectAttribute_data_text_{$attribute.id}&quot; value=&quot;{$attribute.data_text}&quot; /&gt;\n</literal>\n  </paragraph>\n  <paragraph>The second ezemail.tpl is added under ./design/standard/templates/content/datatype/view/, this template file will show the result of the saved email address. </paragraph>\n  <paragraph>\n    <literal>{$attribute.data_text}</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Step 5: Add the new datatype to the site.ini file.</strong>\n  </paragraph>\n  <paragraph>The last step is to add the newly created datatype to the content.ini file so it will be displayed in the datatype dropdown list. Open the content.ini file under ./settings/ with a text editor and find the line with </paragraph>\n  <paragraph>\n    <literal>[DataTypeSettings]\n# A list of directories to check for datatypes\nRepositoryDirectories[]=kernel/classes/datatypes\nExtensionDirectories[]\n\nAvailableDataTypes[]=ezstring\nAvailableDataTypes[]=eztext\nAvailableDataTypes[]=ezxmltext\nAvailableDataTypes[]=ezdate\nAvailableDataTypes[]=ezdatetime\nAvailableDataTypes[]=eztime\nAvailableDataTypes[]=ezboolean\nAvailableDataTypes[]=ezinteger\nAvailableDataTypes[]=ezfloat\nAvailableDataTypes[]=ezenum\nAvailableDataTypes[]=ezobjectrelation\nAvailableDataTypes[]=ezimage\nAvailableDataTypes[]=ezbinaryfile\nAvailableDataTypes[]=ezmedia\nAvailableDataTypes[]=ezauthor\nAvailableDataTypes[]=ezurl\nAvailableDataTypes[]=ezemail\nAvailableDataTypes[]=ezoption\nAvailableDataTypes[]=ezprice\nAvailableDataTypes[]=ezuser\nAvailableDataTypes[]=ezisbn\n</literal>\n  </paragraph>\n  <paragraph>Add a new line with the name of the new datatype to somewhere under [DataTypeSettings] . In this example, we should add line &quot;AvailableDataTypes[]=ezemail&quot; under [DataTypeSettings]. You can check the result by refreshing your browser and then go to the class editing page. If everything goes fine, you should find Email on the dropdown list. </paragraph>\n  <paragraph>In this tutorial, a simple datatype Email, which uses only one field in the database to store its content, was created. To create more complex datatypes, extra tables may need to be added and extra classes may need to be written. Please refer to the eZEnum type for more detail about how complex datatypes can be created. </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (217,'eng-GB',2,85,127,'Creating a new datatype',0,0);
INSERT INTO ezcontentobject_attribute VALUES (218,'eng-GB',2,85,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>When you are creating or editing a class object, you should decide which datatypes are going to be used by your attributes. Although the datatypes that come with eZ publish are powerful enough for creating complex content classes, you might still need to create your own datatypes for specific cases. Creating new datatypes requires having some basic knowledge of how eZ publish datatypes work and which classes are necessary to be changed or added. In the following tutorial, how to create a new datatype is shown step by step using the datatype Email as an example. The Email datatype is used to save email address and implements some check rules to verify that input email is of correct format.</paragraph>\n  <paragraph>\n    <strong>Step 1: Build the file structure for your new datatype.</strong>\n  </paragraph>\n  <paragraph>To make the datatype Email, you should first create the folder ezemail under ./kernel/classes/datatypes/, then create the file called ezemailtype.php under the newly created folder. Note that the name of the folder and PHP file is important since it will be used to locate the file. The basic structure is that if you added a datatype x, it should be stored like this: ./kernel/classes/datatypes/ezx/ezxtype.php.</paragraph>\n  <paragraph>\n    <strong>Step 2: Write the datatype file inherited from file ./kernel/classes/ezdatatype.php.</strong>\n  </paragraph>\n  <paragraph>All datatype files should inherit from the file ./kernel/classes/ezdatatype.php and implement some functions which the super class has defined but not implemented. Let&apos;s work through the code of ezemailtype.php to see how this class was implemented.</paragraph>\n  <paragraph>\n    <literal>\n&lt;?php\n\n// Include the super class file\ninclude_once( &quot;kernel/classes/ezdatatype.php&quot; );\n\n// Include the file which will be used to validate email\ninclude_once( &quot;lib/ezutils/classes/ezmail.php&quot; );\n\n// Define the name of datatype string\ndefine( &quot;EZ_DATATYPESTRING_EMAIL&quot;, &quot;ezemail&quot; );\n\nclass eZEmailType extends eZDataType\n{\n    /*!\n     Construction of the class, note that the second parameter in eZDataType is the actual name\n     showed in the datatype dropdown list.\n    */\n    function eZEmailType( )\n    {\n        $this-&gt;eZDataType( EZ_DATATYPESTRING_EMAIL, &quot;Email&quot; );\n    }\n\n    /*!\n     Validates the input and returns true if the input was valid for this datatype. Here you could\n     add special rules for validating email.\n     Parameters $http holds the class object eZHttpTool which has functions to fetch and check http input.\n     Parameters $base holds the base name of http variable, in this case the base name will be &apos;ContentObjectAttribute&apos;.\n     Parameters $contentObjectAttribute holds the attribue object.\n    */\n    function validateObjectAttributeHTTPInput( &amp;$http, $base, &amp;$contentObjectAttribute )\n    {\n        if ( $http-&gt;hasPostVariable( $base . &apos;_data_text_&apos; . $contentObjectAttribute-&gt;attribute( &apos;id&apos; ) ) )\n        {\n            $email =&amp; $http-&gt;postVariable( $base . &apos;_data_text_&apos; . $contentObjectAttribute-&gt;attribute( &apos;id&apos; ) );\n            $classAttribute =&amp; $contentObjectAttribute-&gt;contentClassAttribute();\n            if( $classAttribute-&gt;attribute( &quot;is_required&quot; ) == true )\n            {\n                if( $email == &quot;&quot; )\n                {\n                    $contentObjectAttribute-&gt;setValidationError( ezi18n( &apos;content/datatypes&apos;,\n                                                                         &apos;A valid email account is required.&apos;,\n                                                                         &apos;eZEmailType&apos; ) );\n                    return EZ_INPUT_VALIDATOR_STATE_INVALID;\n                }\n            }\n            if( $email != &quot;&quot; )\n            {\n                $isValidate =  eZMail::validate( $email );\n                if ( ! $isValidate )\n                {\n                    $contentObjectAttribute-&gt;setValidationError( ezi18n( &apos;content/datatypes&apos;,\n                                                                         &apos;Email address is not valid.&apos;,\n                                                                         &apos;eZEmailType&apos; ) );\n                    return EZ_INPUT_VALIDATOR_STATE_INVALID;\n                }\n            }\n        }\n        return EZ_INPUT_VALIDATOR_STATE_ACCEPTED;\n    }\n\n    /*!\n     Fetches the http post var string input and stores it in the data instance.\n     An email could be easily stored as variable characters, we use data_text filed in database to save it.\n     In the template, the textfile name of email input is something like &apos;ContentObjectAttribute_data_text_idOfTheAttribute&apos;,\n     therefore we fetch the http variable &apos;$base . &quot;_data_text_&quot; . $contentObjectAttribute-&gt;attribute( &quot;id&quot; )&apos;.\n     Again, parameters $base holds the base name of http variable and is &apos;ContentObjectAttribute&apos; in this example.\n    */\n    function fetchObjectAttributeHTTPInput( &amp;$http, $base, &amp;$contentObjectAttribute )\n    {\n        if ( $http-&gt;hasPostVariable( $base . &quot;_data_text_&quot; . $contentObjectAttribute-&gt;attribute( &quot;id&quot; ) ) )\n        {\n            $data =&amp; $http-&gt;postVariable( $base . &quot;_data_text_&quot; . $contentObjectAttribute-&gt;attribute( &quot;id&quot; ) );\n            $contentObjectAttribute-&gt;setAttribute( &quot;data_text&quot;, $data );\n        }\n        return false;\n    }\n\n    /*!\n     Store the content. Since the content has been stored in function fetchObjectAttributeHTTPInput(),\n     this function is with empty code.\n    */\n    function storeObjectAttribute( &amp;$contentObjectattribute )\n    {\n    }\n\n    /*!\n     Returns the content.\n    */\n    function &amp;objectAttributeContent( &amp;$contentObjectAttribute )\n    {\n        return $contentObjectAttribute-&gt;attribute( &quot;data_text&quot; );\n    }\n\n    /*!\n     Returns the meta data used for storing search indices.\n    */\n    function metaData( $contentObjectAttribute )\n    {\n        return $contentObjectAttribute-&gt;attribute( &quot;data_text&quot; );\n    }\n\n    /*!\n     Returns the text.\n    */\n    function title( &amp;$contentObjectAttribute )\n    {\n        return  $contentObjectAttribute-&gt;attribute( &quot;data_text&quot; );\n    }\n}\neZDataType::register( EZ_DATATYPESTRING_EMAIL, &quot;ezemailtype&quot; );\n?&gt;\n}\n</literal>\n  </paragraph>\n  <paragraph>As the code illustrates, it must include the PHP file ezdatatype.php and inherit from eZDataType. The class should implement the functions validateObjectAttributeHTTPInput, fixupObjectAttributeHTTPInput, fetchObjectAttributeHTTPInput, and storeObjectAttribute. The function validateObjectAttributeHTTPInput, which validates the datatype input, and the function fetchObjectAttributeHTTPInput, which gets the datatype input and stores it, are the most important functions that need to be rewritten for every new datatype. Other functions may have the same content. At the end of the file, the new datatype should be registered in the system by calling the register method in the class eZDataType.</paragraph>\n  <paragraph>\n    <line>In this example, the following line</line>\n    <literal>eZDataType::register( EZ_DATATYPESTRING_EMAIL, &quot;ezemailtype&quot; );\n</literal>\n  </paragraph>\n  <paragraph>was added.</paragraph>\n  <paragraph>\n    <strong>Step 3: Add associated template files for the content class.</strong>\n  </paragraph>\n  <paragraph>Not every datatype needs to have a template file in class level since most datatypes can use standard UI supplied with eZ publish. It is only necessary when the datatype has specific constraints that need to be defined during class editing. Examples are setting a default value for the datatype, adding customer action buttons, etc. If so, the datatype file should implement the functions storeClassAttribute, validateClassAttributeHTTPInput, fixupClassAttributeHTTPInput, and fetchClassAttributeHTTPInput which are defined in the super class ezdatatype.php. These functions deal with how to fetch and validate input and then store it in the database. Note that the template file should be located at ./design/standard/templates/class/datatype/edit/ezx.tpl. The datatype Email does not have a specification in class level and therefore nothing needs to be done in this case.</paragraph>\n  <paragraph>\n    <strong>Step 4: Add associated template files for content object.</strong>\n  </paragraph>\n  <paragraph>For every datatype, two template files must to be added. One template file for content object editing and one for content object viewing. In this example, we add one ezemail.tpl (shown below) under ./design/standard/templates/content/datatype/edit/. This is just a normal text field with corresponding name we defined in eZEmailtype.php. Users will use this text field to edit or input email address.</paragraph>\n  <paragraph>\n    <literal>\n&lt;input type=&quot;text&quot; size=&quot;10&quot; name=&quot;ContentObjectAttribute_data_text_{$attribute.id}&quot; value=&quot;{$attribute.data_text}&quot; /&gt;\n</literal>\n  </paragraph>\n  <paragraph>The second ezemail.tpl is added under ./design/standard/templates/content/datatype/view/, this template file will show the result of the saved email address.</paragraph>\n  <paragraph>\n    <literal>{$attribute.data_text}</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Step 5: Add the new datatype to the site.ini file.</strong>\n  </paragraph>\n  <paragraph>The last step is to add the newly created datatype to the content.ini file so it will be displayed in the datatype dropdown list. Open the content.ini file under ./settings/ with a text editor and find the line with</paragraph>\n  <paragraph>\n    <literal>[DataTypeSettings]\n# A list of directories to check for datatypes\nRepositoryDirectories[]=kernel/classes/datatypes\nExtensionDirectories[]\n\nAvailableDataTypes[]=ezstring\nAvailableDataTypes[]=eztext\nAvailableDataTypes[]=ezxmltext\nAvailableDataTypes[]=ezdate\nAvailableDataTypes[]=ezdatetime\nAvailableDataTypes[]=eztime\nAvailableDataTypes[]=ezboolean\nAvailableDataTypes[]=ezinteger\nAvailableDataTypes[]=ezfloat\nAvailableDataTypes[]=ezenum\nAvailableDataTypes[]=ezobjectrelation\nAvailableDataTypes[]=ezimage\nAvailableDataTypes[]=ezbinaryfile\nAvailableDataTypes[]=ezmedia\nAvailableDataTypes[]=ezauthor\nAvailableDataTypes[]=ezurl\nAvailableDataTypes[]=ezemail\nAvailableDataTypes[]=ezoption\nAvailableDataTypes[]=ezprice\nAvailableDataTypes[]=ezuser\nAvailableDataTypes[]=ezisbn\n</literal>\n  </paragraph>\n  <paragraph>Add a new line with the name of the new datatype to somewhere under [DataTypeSettings] . In this example, we should add line &quot;AvailableDataTypes[]=ezemail&quot; under [DataTypeSettings]. You can check the result by refreshing your browser and then go to the class editing page. If everything goes fine, you should find Email on the dropdown list.</paragraph>\n  <paragraph>\n    <line>In this tutorial, a simple datatype Email, which uses only one field in the database to store its content, was created. To create more complex datatypes, extra tables may need to be added and extra classes may need to be written. Please refer to the eZEnum type for more detail about how complex datatypes can be created.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (219,'eng-GB',1,86,124,'Permissions and sections',0,0);
INSERT INTO ezcontentobject_attribute VALUES (220,'eng-GB',1,86,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>With the permission (roles) system in eZ Publish 3 you can very flexibly limit access to different parts of your content. One of the ways to do it is to give limited access to the sections of your site. For example can you have a web shop with articles and products and two groups of persons, where one group of persons can write articles in the &quot;articles&quot; section and the other group updates the products.</paragraph>\n  <paragraph>To make such a configuration you need to do the next five steps:</paragraph>\n  <paragraph>\n    <ul>\n      <li>you need to define two sections.</li>\n      <li>assign these sections to a different parts of you sitemap tree</li>\n      <li>create two different roles (or you can use already existing roles and just change the access policies)</li>\n      <li>set up policies for these user roles</li>\n      <li>assign these roles to the users.</li>\n    </ul>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (221,'eng-GB',1,86,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Define and assign sections</header>\n    <paragraph>To create a new section you need to go to the sections part of the admin interface in the &quot;Set up&quot; menu box and click the &quot;New&quot; button there. Create two sections: &quot;Articles&quot; and &quot;Products&quot;.</paragraph>\n    <paragraph>\n      <object id=\"87\" />\n    </paragraph>\n    <paragraph>To assign the created sections to certain parts of your site you click the &quot;assign&quot; link. You will see the so called &quot;browse&quot; page in which you can select one or more folders (in general any object of any class) to assign the section to. After you select a folder the system will assign the section to that folder and all its children.</paragraph>\n    <paragraph>\n      <object id=\"88\" />\n    </paragraph>\n  </section>\n</section>',1045487555,0);
