INSERT INTO ezcontentobject_attribute VALUES (230,'eng-GB',1,89,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>Go to the &quot;roles&quot; page. Create a new role with the &quot;New&quot; button. You will be redirected to the role edit page. There you can set the name for the role and set up policies. To create a new policy for the role you click &quot;New&quot; at the edit page.</paragraph>\n  <paragraph>\n    <object id=\"92\" />\n  </paragraph>\n  <paragraph>\n    <ol>\n      <li>selecting a module</li>\n      <li>selecting a function </li>\n      <li>creating limitations for function</li>\n    </ol>\n  </paragraph>\n</section>',1045487555,0);
