INSERT INTO ezcontentobject_attribute VALUES (248,'eng-GB',1,97,127,'Adding limitations to the function',0,0);
INSERT INTO ezcontentobject_attribute VALUES (249,'eng-GB',1,97,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>You create &quot;policy limitations&quot; when you want to allow the user to execute a module function with some limitations. For example a user can read content from section &quot;1&quot; and only articles from that section. &quot;Section 1&quot; and &quot;only articles&quot; are limitations. So in our case we need to create a limitation policy which will allow users to create objects only in one section. Depending on what role you are editing now (for article editors or for product editors) you need to select proper section(s) from the list.</paragraph>\n  <paragraph>\n    <object id=\"98\" />\n  </paragraph>\n  <paragraph>In addition to section limitations you can limit access by classes as well. For example for &quot;article editors&quot; you want to limit the classes of objects they can create to folders and articles. This is shown in the picture above. </paragraph>\n  <paragraph>After selecting limitations you click the &quot;Ok&quot; button which will add the policy to the role. </paragraph>\n  <paragraph>You need to create policies for each function in the &quot;content&quot; module. Create new policies according to the permissions you want to give to the users that role is assigned to. </paragraph>\n  <paragraph>To save the role you click the &quot;Apply&quot; button on the &quot;role edit&quot; page. Modifications to the role are not visible for the system until you save the role. </paragraph>\n  <paragraph>Now you need to repeat the steps described above for another role (&quot;Product editors&quot;). You must select different limitation parameters according to the role you are setting up.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (250,'eng-GB',1,98,116,'Permissions and sections - policy_step3',0,0);
INSERT INTO ezcontentobject_attribute VALUES (251,'eng-GB',1,98,117,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (252,'eng-GB',1,98,118,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (253,'eng-GB',1,99,127,'Assign these roles to the users',0,0);
INSERT INTO ezcontentobject_attribute VALUES (254,'eng-GB',1,99,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>After you have created the roles, you need to assign them to users or user groups. If you are planning to have a couple of product and article editors it is better to create two user groups and assign the roles to these user groups. After that any users in these groups will have the roles assigned to them. You can assign roles to users from two places: From the role/view page or from the role/list page. You are redirected to the role/view page after applying modifications to the role.</paragraph>\n  <paragraph>\n    <object id=\"100\" />\n  </paragraph>\n  <paragraph>After clicking the &quot;Assign&quot; button you will be redirected to the &quot;browse&quot; page. You can select user groups or users there. By clicking &quot;select&quot; on that page you assign the role to the selected groups or users. </paragraph>\n  <paragraph>After assigning roles to the users the configuration is done. </paragraph>\n</section>',1045487555,0);
