INSERT INTO ezcontentobject_attribute VALUES (258,'eng-GB',1,101,124,'Creating forms',0,0);
INSERT INTO ezcontentobject_attribute VALUES (259,'eng-GB',1,101,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>In this tutorial we will create a feedback form where users can tell what they like and don&apos;t like about your site.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (260,'eng-GB',1,101,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Creating a new class</header>\n    <paragraph>The first thing thing we need to do is create a new class for our feedback form. Afterwards, we&apos;ll use this class to create new forms.</paragraph>\n    <paragraph>Login to your admin site and choose &apos;Classes&apos; under the &apos;Set up&apos; section. Enter one of the class groups. These groups are used to categorize your classes. After entering one of the class groups press the &apos;New&apos; button to create a new class. You should be presented with the page shown below.</paragraph>\n    <paragraph>\n      <object id=\"102\" />\n    </paragraph>\n    <paragraph>Now we need to add the different attributes we want our class to contain. For this example we will add four attributes: Name, Email receiver, Subject and a Feedback field. We will fill in the first two fields when we create a new form. The last two fields are meant for the user to fill in. Add the attributes as shown in the picture below.</paragraph>\n    <paragraph>\n      <object id=\"103\" />\n    </paragraph>\n    <paragraph>As you can see on the above picture attribute 3 and 4 have &apos;Information Collector&apos; checked. This enables the data in the attribute to be stored or sent. </paragraph>\n    <paragraph>If you only want one form on your site, or you want all the input from different forms mailed to the same address you do not need the &apos;email receiver&apos; attribute. It is possible to set the email receiver in settings/site.ini, but we want the ability to set different addresses for different forms. </paragraph>\n    <paragraph>When you are done adding the attributes click on &apos;Store&apos;. </paragraph>\n  </section>\n</section>',1045487555,0);
