INSERT INTO ezcontentobject_attribute VALUES (268,'eng-GB',1,104,127,'Creating a new form',0,0);
INSERT INTO ezcontentobject_attribute VALUES (269,'eng-GB',1,104,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>It is now time to use our class to create a form. Go to a location on the site you want your form, select &apos;Submission form&apos; from the drop down menu and click &apos;New&apos;. Fill in the Name and Email receiver field. The two last fields are meant for the user to fill in so leave those blank. If the email address you set in the Email receiver field is invalid, the default address from settings/site.ini will be used. When you are done click on &apos;Send for publishing&apos;.</paragraph>\n  <paragraph>Before we proceed with customizing the form check that it works. Click on the form you created, fill in some test data, click on &apos;send&apos; and confirm that the data was sent to the email address you specified.</paragraph>\n  <section>\n    <header>Creating a template</header>\n    <paragraph>We want to customize the look and layout of our form. To accomplish this we need to create our own template which will be used whenever an instance (a form created with the class we made in the beginning of the tutorial) of our form class is viewed. The first information we need is the Class ID for our form class. Go to &apos;Classes&apos; under &apos;Set up&apos; and choose the class group you created your form class in. You should now be viewing a list of classes. The numbers in the first column are the class IDs. Get the ID for the form class we created.</paragraph>\n    <paragraph>With the ID of the class we are going to create a new file called &apos;full_class_ID.tpl&apos;. Replace &apos;ID&apos; with the ID of the form class. This file will be the full view for the class with the given ID. Place the file in &apos;design/standard/override/templates/node/view&apos;. Shown below is an example of a template.</paragraph>\n    <paragraph>\n      <literal>\n{default content_object=$node.object\n         content_version=$node.contentobject_version_object\n         node_name=$node.name}\n\n&lt;h1&gt;{$node.data_map.name.content}&lt;/h1&gt;\n&lt;p&gt;\nWe have just started this page and would like you to send your comments, ideas, \nimprovement suggestions and critique to help us further \ndevelop this page. This page is made for you, \nthe users, so here is your chance to contribute and make it the way you want it.\n&lt;/p&gt;\n\n&lt;form method=&quot;post&quot; action={&quot;content/action&quot;|ezurl}&gt;\n\n&lt;table width=&quot;100%&quot; cellspacing=&quot;10&quot; cellpadding=&quot;0&quot; border=&quot;0&quot;&gt;\n&lt;tr&gt;\n    &lt;td&gt;\n    &lt;b&gt;Subject&lt;/b&gt;\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n    &lt;td&gt;\n    {attribute_view_gui attribute=$node.data_map.subject}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n\n&lt;table width=&quot;100%&quot; cellspacing=&quot;10&quot; cellpadding=&quot;0&quot; border=&quot;0&quot;&gt;\n&lt;tr&gt;\n    &lt;td&gt;\n    &lt;b&gt;Feedback&lt;/b&gt;\n    &lt;/td&gt;\n&lt;/tr&gt;\n\n&lt;tr&gt;\n    &lt;td&gt;\n    {attribute_view_gui attribute=$node.data_map.feedback}\n    &lt;/td&gt;\n&lt;/tr&gt;\n&lt;/table&gt;\n\n{section name=ContentAction loop=$content_object.content_action_list show=$content_object.content_action_list}\n    &lt;div class=&quot;block&quot;&gt;\n        &lt;input type=&quot;submit&quot; name=&quot;{$ContentAction:item.action}&quot; value=&quot;{$ContentAction:item.name}&quot; /&gt;\n    &lt;/div&gt;\n{/section}\n\n&lt;input type=&quot;hidden&quot; name=&quot;ContentNodeID&quot; value=&quot;{$node.node_id}&quot; /&gt;\n&lt;input type=&quot;hidden&quot; name=&quot;ContentObjectID&quot; value=&quot;{$content_object.id}&quot; /&gt;\n&lt;input type=&quot;hidden&quot; name=&quot;ViewMode&quot; value=&quot;full&quot; /&gt;\n\n&lt;/form&gt;\n\n{/default}\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>The final result:</line>\n      <object id=\"105\" />\n    </paragraph>\n    <paragraph>The final thing that needs to be done is change the collectedinfomail.tpl located in &apos;design/standard/template/content&apos;. The content of this template is what will be sent by mail. </paragraph>\n    <paragraph>\n      <literal>{set-block scope=root variable=subject}{&quot;Collected information from:&quot;|i18n(&quot;design/standard/content/edit&quot;)}\n{$collection.object.name} {/set-block}\n{set-block scope=root variable=email_receiver}{$object.data_map.email_receiver.content}{/set-block}\n\n{&quot;The following information was collected:&quot;|i18n(&quot;design/standard/content/edit&quot;)}\n\n{section name=Attribute loop=$collection.attributes}\n{$Attribute:item.contentclass_attribute_name}:\n{$Attribute:item.data_text}\n{/section}\n</literal>\n    </paragraph>\n    <paragraph>What we did here was to make the email_receiver variable correspond to whatever email address we enter in the email_receiver attribute. </paragraph>\n  </section>\n</section>',1045487555,0);
