INSERT INTO ezcontentobject_attribute VALUES (273,'eng-GB',1,106,124,'Translation and i18n',0,0);
INSERT INTO ezcontentobject_attribute VALUES (274,'eng-GB',1,106,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>What you need</header>\n    <paragraph>eZ publish 3 requires two programs to create and maintain translations, ezlupdate and linguist. These programs are based on the same tools from the Qt toolkit by Trolltech. The unix version of this toolkit is released under the GPL. eZ systems provides binaries for Windows and Mac OS X, see the translations page on ez.no/developer. </paragraph>\n    <paragraph>The linguist is unmodified from the Qt original, so you can also get it from other sources, such as RPMs. If you run Linux or a similar system, you will find the linguist as part of qt-3.*, qt-devel-3.* or a similarly named package. </paragraph>\n    <paragraph>The ezlupdate program is modified to make it understand eZ publish files. You will find the source code and build instructions in support/lupdate-ezpublish3 in the eZ publish distribution.</paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (275,'eng-GB',1,106,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Making translations</header>\n    <paragraph>\n      <strong>Note:</strong> The database content of eZ publish is not translated, meaning that for instance class attributes are shown in English wherever this information is visible. This is normally only in the admin interface. The classes provided with eZ publish are merely examples provided to get you up and running quickly. You are encouraged to extend and/or replace these classes with your own classes. If you need a non-English administrative interface, you can translate your classes in the &quot;Setup&quot; section. (The translation system covers content in templates and PHP code.) </paragraph>\n    <paragraph>You must decide the locale code of your language. eZ publish 3 uses locale codes on the form aaa-AA, where the 3 first lowercase letters describe the language, while the last two uppercase letter describe the country in which the language is spoken. For instance, English as it is spoken in Great Britain would be eng-GB, while US English is eng-US. </paragraph>\n    <paragraph>Countries are specified by the ISO 3166 Country Code:       \n      <link id=\"3\">http://www.iso.ch/iso/en/prods-services/iso3166ma/index.html </link>\n    </paragraph>\n    <paragraph>Language is specified by the ISO 639 Language Code:       \n      <link id=\"4\">http://www.w3.org/WAI/ER/IG/ert/iso639.htm</link>\n    </paragraph>\n    <paragraph>You can also create a variation of a locale, you will for instance find two variations of nor-NO, nor-NO@intl and nor-NO@spraakraad, that are slight modifications of the original. </paragraph>\n    <paragraph>For the rest of this part, I assume you are translating nor-NO. </paragraph>\n    <paragraph>Copy share/locale/eng-GB.ini to share/locale/nor-NO.ini. Edit this file with a text editor. Here you set locale details such as time formats, currency and the names of the week days. </paragraph>\n    <paragraph>\n      <line>Now, enter the main eZ publish directory in a terminal and type </line>\n      <literal>\nbin/linux/ezlupdate -v nor-NO\n</literal>\n    </paragraph>\n    <paragraph>(Provided that nor-NO is your locale, of course. -v is for verbose, showing messages about what happens. You can also use -vv for extra verbose output, or omit it for silent behavior. Run bin/linux/ezlupdate -h for an explanation of the arguments. </paragraph>\n    <paragraph>You will now find a translation in share/translations/nor-NO/translation.ts or similar for other locales. Open this file in linguist and do the translation. </paragraph>\n    <paragraph>You will find documentation on linguist on Trolltechs page:       \n      <link id=\"5\">http://doc.trolltech.com/3.0/linguist-manual-3.html</link>\n    </paragraph>\n    <paragraph>When you are done translating in linguist (or earlier, if you want to test part of a translation), open settings/site.ini. Go to the section [RegionalSettings] and set Locale=nor-NO. Also set TextTranslation=enabled, or the default (eng-GB) will be used. </paragraph>\n    <paragraph>Sample entry in settings/site.ini: </paragraph>\n    <paragraph>\n      <literal>\n[RegionalSettings]\nLocale=nor-NO\nTextTranslation=enabled\n</literal>\n    </paragraph>\n    <paragraph>If you run a multi-language site, you will also need to translate content objects. Set ContentObjectLocale=nor-NO if you want the default language to be nor-NO. Important: Before you do this, you should make sure that the new locale is added to the system. Go to Setup -&gt; Translations and add your locale here if it does not exist. You should also translate the most used objects of your site before you change the ContentObjectLocale. To translate an object, edit it, and click &quot;Edit&quot; under &quot;Translations&quot; in the right-hand menu. </paragraph>\n    <paragraph>\n      <line>To distribute your translation, create a compressed archive, for instance .zip or tar.gz, of these two files:</line>\n      <line> share/locale/nor-NO.ini</line>\n      <line> share/translations/nor-NO/translation.ts </line>\n    </paragraph>\n    <paragraph>\n      <line>You could for instance do it like this: </line>\n      <literal>\ntar -zcvf nor-NO.tar.gz \\\n share/locale/nor-NO.ini share/translations/nor-NO/translation.ts\n</literal>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (276,'eng-GB',1,106,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (277,'eng-GB',1,107,127,'Installing translations',0,0);
INSERT INTO ezcontentobject_attribute VALUES (278,'eng-GB',1,107,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>To install a translation, simply unpack the package and set the appropriate entries in settings/site.ini. These are the keys you need to change to enable the translation: </paragraph>\n  <paragraph>\n    <literal>\n[RegionalSettings]\nLocale=nor-NO\nTextTranslation=enabled\nTranslationCache=enabled\n</literal>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (279,'eng-GB',1,108,127,'Making i18n-friendly templates',0,0);
INSERT INTO ezcontentobject_attribute VALUES (280,'eng-GB',1,108,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>All user-visible strings in templates should be embedded in the i18n operator. All such strings can be translated in the linguist. The     \n    <strong>i18n operator</strong> is used like this: </paragraph>\n  <paragraph>\n    <literal>\n&lt;b&gt;{&quot;This text can be translated&quot;|i18n(&quot;design/mydesign/path&quot;)}&lt;/b&gt;\n&lt;input type=&quot;submit&quot; name=&quot;MyButton&quot;\n value=&quot;{&apos;My Cool Button&apos;|i18n(&apos;design/mydesign/path&apos;)}&quot; /&gt;\n{include uri=&quot;design:gui/button.tpl&quot; name=remove id_name=RemoveButton\n value=&quot;Click to remove&quot;|i18n(&quot;design/mydesign/path&quot;)}\n</literal>\n  </paragraph>\n  <paragraph>The path in this example, design/mydesign/path, is used as a context. It is by this     \n    <strong>context</strong> that the strings are sorted in the linguist. The context does not have to be the actual path to the template file in question, but this can be useful. See the templates of the admin interface for examples. </paragraph>\n  <paragraph>You can also add an optional     \n    <strong>comment</strong> as a second argument to the i18n operator. Such comments are shown in the linguist. Use this for instance to explain how a word is used, this can be helpful for translators. </paragraph>\n  <paragraph>If you need to add     \n    <strong>variables</strong>, use the third argument to the i18n operator. </paragraph>\n  <paragraph>\n    <literal>\n&lt;b&gt;{&quot;The node %1 is a child of %2.&quot;|i18n(&quot;design/mydesign/path&quot;,,\n array($node.name,$parent_node.name))}&lt;/b&gt;\n&lt;b&gt;{&quot;The node %node is a child of %parent_node.&quot;|i18n(&quot;design/mydesign/path&quot;,,\n hash(&quot;%node&quot;,$node.name,&quot;%parent_node&quot;,$parent_node.name))}&lt;/b&gt;\n</literal>\n  </paragraph>\n  <paragraph>As the examples show, variables can be used in two ways. You can use the keys %1 to %9, and an array of values to replace them with. You can also use any key you want, as long as you specify them in a hash. Note that automatic translators, such as the Bork translator, may not treat the keys correctly. </paragraph>\n  <paragraph>The i18n operator calls the     \n    <strong>ezi18n()</strong> function in     \n    <strong>kernel/common/i18n.php</strong>. If translation is not enabled in settings/site.ini, then it will simply output the source it is given. Otherwise, it will look up the string in the corresponding .ts file. If a translation is not found, it will use the automatic Bork translation. This is useful, as it makes it easy to spot strings that don&apos;t have the i18n operator. </paragraph>\n  <paragraph>In     \n    <strong>extensions</strong> you should use the x18n operator instead of i18n. The only difference is that x18n takes an additional parameter before the others: The name of the extension.</paragraph>\n  <paragraph>\n    <literal>\n&lt;b&gt;{&quot;The node %1 is a child of %2.&quot;|x18n(&quot;myextension&quot;,&quot;design/mydesign/path&quot;,,\n array($node.name,$parent_node.name))}&lt;/b&gt;\n</literal>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (281,'eng-GB',1,109,127,'Making i18n-friendly PHP code',0,0);
INSERT INTO ezcontentobject_attribute VALUES (282,'eng-GB',1,109,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>All user-visible strings in PHP-code should be embedded in the     \n    <strong>ezi18n()</strong> function. It is similar to the template operator, except that it takes the source as the second argument. For extensions, use     \n    <strong>ezx18n()</strong>. As with the template operator, you can also use arguments. Use either a plain array and the keys %1 to %9, or an associative array where you specify the keys yourself. </paragraph>\n  <paragraph>\n    <literal>\n$myObject-&gt;myFunction( ezi18n( &apos;kernel/classes/datatypes&apos;,\n                               &apos;Input is not integer.&apos;,\n                               &apos;Comment: eZIntegerType&apos; ) );\n\n$myObject-&gt;myFunction( ezx18n( &apos;myextension&apos;\n                               &apos;modules/mymodule&apos;,\n                               &apos;Input is not integer.&apos;,\n                               &apos;Comment: eZIntegerType&apos; ) );\n\n$myObject-&gt;myFunction( ezi18n( &apos;kernel/classes/datatypes&apos;,\n                               &apos;The node %1 is a child of %2.&apos;,\n                               null,\n                               array( $node-&gt;name(), $parent_node-&gt;name() ) ) );\n\n$myObject-&gt;myFunction( ezx18n( &apos;myextension&apos;\n                               &apos;modules/mymodule&apos;,\n                               &apos;The node %node is a child of %parent_node.&apos;,\n                               null,\n                               array( &quot;%node&quot; =&gt; $node-&gt;name(),\n                                      &quot;%parent_node&quot; =&gt; $parent_node-&gt;name() ) ) );\n</literal>\n  </paragraph>\n</section>',1045487555,0);
