INSERT INTO ezcontentobject_attribute VALUES (294,'eng-GB',1,113,124,'Install using installers',0,0);
INSERT INTO ezcontentobject_attribute VALUES (295,'eng-GB',1,113,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph> There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup wizard which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup wizard and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (296,'eng-GB',1,113,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>The installers are designed as a quick way to get eZ publish up and running for testing purposes. If you plan on using eZ publish for more than just testing, we recommend you install it manually, either by letting the setup guide do the configuration or by configuring eZ publish by hand. </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (297,'eng-GB',1,113,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (298,'eng-GB',1,114,127,'Windows installer',0,0);
INSERT INTO ezcontentobject_attribute VALUES (299,'eng-GB',1,114,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <ol>\n      <li>Go to http://ez.no/developer/download</li>\n      <li>Find the Windows installer matching your Windows version.</li>\n      <li>Download the installer to your hard drive.</li>\n      <li>Double click on the downloaded file and follow the instructions. Choose demo data if you want to see an example of how to use eZ publish.</li>\n      <li>Now the installation will start. This can take a few minutes.</li>\n      <li>When the installation is done, you need to start eZ publish by clicking on the eZ publish icon on the desktop. This will open eZ publish in your default browser. eZ publish will open at the User site. To start the Admin site simply write /admin at the end of the URL. Log in with admin as user name, and publish as password.</li>\n      <li>You are now ready to start using eZ publish.</li>\n    </ol>\n  </paragraph>\n  <paragraph>\n    <strong>Note:</strong> If you have anything listening on the same port as Apache (80) or MySQL (3306) you need to shut those services down. Apache and MySQL won&apos;t start if port 80 or 3306 are in use. </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (300,'eng-GB',1,115,127,'Linux installer',0,0);
INSERT INTO ezcontentobject_attribute VALUES (301,'eng-GB',1,115,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>1. Open your web browser and go to http://ez.no/download</line>\n    <line>2. Find the Linux installer matching your distribution. These installers are tested on Redhat Linux, but should work fine on several other distributions as well.</line>\n    <line>3. Become root by running</line>\n    <literal>\n$ su - \n</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Note:</strong> it is important that you run &quot;su -&quot;, and not &quot;su&quot;. The installer needs to have system variables for the root user.</paragraph>\n  <paragraph>\n    <line>4. Unpack the downloaded file</line>\n    <literal>\n# tar xvfz ezpublish-3.0-xxx-x-Linux-xxx.i386.tar.gz\n</literal>\n  </paragraph>\n  <paragraph>\n    <line> Replace ezpublish-3.0-xxx-x-Linux-xxx.i386.tar.gz with your current version.</line>\n    <line>5. Enter the extracted directory</line>\n    <literal>\n# cd ezpublish-3.0-xxx-x-Linux-xxx.i386 \n</literal>\n  </paragraph>\n  <paragraph>\n    <line>Run the installation program</line>\n    <line>6. </line>\n    <literal>\n# ./install.sh\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>7. Choose &quot;install eZ publish&quot; and press Enter</line>\n    <line>8. If you only have one network card press enter on the question on &quot;What is your internal network card&quot;. If you have more than one card enter the name of the network device connected to your network. </line>\n    <line>9. Enter port number for the user demo site, press enter for default port (1337)</line>\n    <line>10. Enter port number for the admin site, press enter for default port (1338). Check for installation of demo data if you want this. If not you will get a clean setup. Clean setup is useful when starting to develop a new site. The demo data is useful for testing the system.</line>\n    <line>10. You will get a report of what&apos;s installed.</line>\n    <line>11. &quot;OK&quot; to quit</line>\n  </paragraph>\n  <paragraph> Installation of eZ publish 3 is now done. You can access the demo site at: http://localhost:1337 and the default admin site at http://localhost:1338 </paragraph>\n</section>',1045487555,0);
