f what&apos;s installed.</paragraph>\n  <paragraph>12. &quot;OK&quot; to quit</paragraph>\n  <paragraph>\n    <line>Installation of eZ publish 3 is now done. You can access the demo site at: http://localhost:1337 and the default admin site at http://localhost:1338</line>\n  </paragraph>\n</section>',1045487555,0);
