INSERT INTO ezcontentobject_attribute VALUES (303,'eng-GB',1,116,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>1. Open your web browser and go to http://ez.no/download</paragraph>\n  <paragraph>2. Find the FreeBSD installer. This installer is tested on FreeBSD 4.6.2, but should work on other versions of FreeBSD as well. </paragraph>\n  <paragraph>\n    <line>3. Become root by running: </line>\n    <literal>\n$ su - \n</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Note:</strong> it is important that you run &quot;su -&quot;, and not &quot;su&quot;. The installer needs to have system variables for the root user.</paragraph>\n  <paragraph>\n    <line>4. Unpack the downloaded file </line>\n    <literal>\n# tar xvfz ezpublish-3.0-xxx-x-FreeBSD-STABLE.i386.tar.gz\n</literal>\n  </paragraph>\n  <paragraph> Replace ezpublish-3.0-xxx-x-FreeBSD-STABLE.i386.tar.gz with your current version.</paragraph>\n  <paragraph>\n    <line>5. Enter the extracted directory </line>\n    <literal>\n# cd ezpublish-3.0-xxx-x-FreeBSD-STABLE.i386\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>6. Run the installation program: </line>\n    <literal>\n# ./install.sh\n</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Note: The FreeBSD Installer requires bash to be located under /usr/local/bin. If you do not have bash installed please refer to the FreeBSD Handbook for more help on installing bash.</strong>\n  </paragraph>\n  <paragraph>7. Choose &quot;install eZ publish 3&quot; and press Enter</paragraph>\n  <paragraph>8. Enter the device name of your network card. You can find the name of your network card by running &quot;ldconfig&quot;. </paragraph>\n  <paragraph>9. Enter port number for the user demo site, press enter for default port (1337).</paragraph>\n  <paragraph>10. Enter port number for the admin site, press enter for default port (1338). Check for installation of demo data if you want this. If not you will get a clean setup. Clean setup is useful when starting to develop a new site. The demo data is useful for testing the system.</paragraph>\n  <paragraph>\n    <line>11. You will get a report of what&apos;s installed.</line>\n    <line>12. &quot;OK&quot; to quit</line>\n  </paragraph>\n  <paragraph>Installation of eZ publish 3 is now done. You can access the demo site at: http://localhost:1337 and the default admin site at http://localhost:1338 </paragraph>\n</section>',1045487555,0);
