starting to develop a new site. The demo data is useful for testing the system.</paragraph>\n  <paragraph>\n    <line>11. You will get a report of what&apos;s installed.</line>\n    <line>12. &quot;OK&quot; to quit</line>\n  </paragraph>\n  <paragraph>\n    <line>Installation of eZ publish 3 is now done. You can access the demo site at: http://localhost:1337 and the default admin site at http://localhost:1338</line>\n  </paragraph>\n</section>',1045487555,0);
