 clean setup. Clean setup is useful when starting to develop a new site. The demo data is useful for testing the system.</paragraph>\n  <paragraph>11. You will get a report of what&apos;s installed.</paragraph>\n  <paragraph>12. &quot;OK&quot; to quit</paragraph>\n  <paragraph>\n    <line>Installation of eZ publish 3 is now done. You can access the demo site at: http://localhost:1337 and the default admin site at http://localhost:1338</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (300,'eng-GB',7,115,127,'Linux installer',0,0);
INSERT INTO ezcontentobject_attribute VALUES (301,'eng-GB',7,115,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>1. Open your web browser and go to     \n    <link id=\"6\">http://ez.no/developer/download</link>\n  </paragraph>\n  <paragraph>2. Find the Linux installer matching your distribution. These installers are tested on Redhat Linux, but should work fine on several other distributions as well.</paragraph>\n  <paragraph>\n    <line>3. Become root by running</line>\n    <literal>$ su - \n</literal>\n  </paragraph>\n  <paragraph>\n    <strong>Note:</strong> it is important that you run &quot;su -&quot;, and not &quot;su&quot;. The installer needs to have system variables for the root user.</paragraph>\n  <paragraph>\n    <line>4. Unpack the downloaded file</line>\n    <literal># tar xvfz ezpublish-x.x-x.Linux-xxx.i386.tar.gz\n</literal>\n  </paragraph>\n  <paragraph>Replace ezpublish-x.x-x.Linux-xxx.i386.tar.gz with your current version.</paragraph>\n  <paragraph>\n    <line>5. Enter the extracted directory</line>\n    <literal># cd ezpublish-x.x-x.Linux-xxx.i386.tar.gz\n</literal>\n  </paragraph>\n  <paragraph>\n    <line>6. Run the installation program</line>\n    <literal># ./install.sh\n</literal>\n  </paragraph>\n  <paragraph>7. Choose &quot;install eZ publish&quot; and press Enter</paragraph>\n  <paragraph>8. If you only have one network card press enter on the question on &quot;What is your internal network card&quot;. If you have more than one card enter the name of the network device connected to your network.</paragraph>\n  <paragraph>9. Enter port number for the user demo site, press enter for default port (1337)</paragraph>\n  <paragraph>10. Enter port number for the admin site, press enter for default port (1338). Check for installation of demo data if you want this. If not you will get a clean setup. Clean setup is useful when starting to develop a new site. The demo data is useful for testing the system.</paragraph>\n  <paragraph>11. You will get a report of what&apos;s installed.</paragraph>\n  <paragraph>12. &quot;OK&quot; to quit</paragraph>\n  <paragraph>\n    <line>Installation of eZ publish 3 is now done. You can access the demo site at: http://localhost:1337 and the default admin site at http://localhost:1338</line>\n  </paragraph>\n</section>',1045487555,0);
