INSERT INTO ezcontentobject_attribute VALUES (308,'eng-GB',1,118,124,'Install eZ publish 3 using the setup guide',0,0);
INSERT INTO ezcontentobject_attribute VALUES (309,'eng-GB',1,118,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>You need to have Apache and PHP, and MySQL or PostgreSQL, installed to run eZ publish 3. PHP needs to have compiled-in support for either MySQL or PostgreSQL. For image conversion support you need to have GD compiled in PHP or ImageMagick installed on your system. </paragraph>\n  <paragraph>\n    <ul>\n      <li>\n        <line>PHP &gt;= 4.2.3 </line>\n        <line>\n          <link id=\"7\">http://www.php.net </link>\n        </line>\n      </li>\n      <li>Apache 1.3 (apache 2.0 works, but it is not well tested)        \n        <link id=\"8\">http://www.apache.org</link>\n      </li>\n      <li>\n        <line>Either MySQL or PostgreSQL</line>\n        <line>\n          <link id=\"9\">http://www.mysql.org</link>\n        </line>\n        <line>\n          <link id=\"10\">http://www.postgresql.org</link>\n        </line>\n      </li>\n      <li>\n        <line> ImageMagick and/or GD compiled in PHP for image conversion and scaling (not required) </line>\n        <line>\n          <link id=\"11\">http://www.imagemagick.org</link>\n        </line>\n      </li>\n    </ul>\n  </paragraph>\n  <paragraph>The installation processes for the above programs are very well documented on their respective home pages, so we will not include that here.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (310,'eng-GB',1,118,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (311,'eng-GB',1,118,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (312,'eng-GB',1,119,127,'Using the setup guide on Windows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (313,'eng-GB',1,119,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Database setup</header>\n    <paragraph>\n      <line>\n        <strong>MySQL</strong>\n      </line>\n      <line>We need to login, create a new database, grant permissions to a user and insert a database. </line>\n    </paragraph>\n    <paragraph>1, Open a console window (start-&gt;run-&gt;cmd.exe or start-&gt;run-&gt;command.exe depending on the Windows version)</paragraph>\n    <paragraph>2. Go to your the location of mysql and find the mysql.exe file (should be under bin\\)</paragraph>\n    <paragraph>\n      <line>3. Run </line>\n      <literal>mysql.exe -u root -p &lt;your_mysql_password&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>4. You should now have a mysql&gt; prompt. Type these mysql statements </line>\n      <literal>mysql&gt; create database &lt;name_of_database&gt;;</literal>\n    </paragraph>\n    <paragraph>\n      <line>5. Grant permissions  </line>\n      <literal>mysql&gt; grant all on .* to &lt;user&gt;@localhost identified by &apos;&lt;password&gt;&apos;;</literal>\n    </paragraph>\n    <section>\n      <header>Starting the setup guide</header>\n      <paragraph>1. Make sure you have met the eZ publish requirements</paragraph>\n      <paragraph>2. Go to         \n        <link id=\"6\">http://ez.no/developer/download</link> and download the latest release of eZ publish</paragraph>\n      <paragraph>3. Extract the downloaded eZ publish file somewhere on Apache&apos;s DocumentRoot and rename it to something nice like &apos;ezpublish&apos;</paragraph>\n      <paragraph>4. Open a browser and enter the url for your eZ publish installation</paragraph>\n      <paragraph>5. Follow the setup guide instructions</paragraph>\n      <paragraph>6. When you have finished the setup guide you should be able to login on the admin page with &apos;admin&apos; as username and &apos;publish&apos; as password. If you installed demo data append &apos;/demo&apos; to the URL, if not append &apos;/user&apos; to view the user site.</paragraph>\n      <paragraph>See the         \n        <link id=\"12\">site access section</link> for more info on changing the way you access the user/admin site. </paragraph>\n      <paragraph>\n        <strong>Note:</strong> The setup guide creates a new settings/site.ini.php which overrides the default settings/site.ini</paragraph>\n    </section>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (314,'eng-GB',1,120,127,'Linux, FreeBSD and Mac OS X ',0,0);
INSERT INTO ezcontentobject_attribute VALUES (315,'eng-GB',1,120,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Database setup</header>\n    <paragraph>We need to login, create a new database, grant permissions to a user and insert a database. If you already have a database with correct permissions, then the setup guide can use that database. If not, you must create it yourself: </paragraph>\n    <paragraph>\n      <strong>MySQL</strong>\n    </paragraph>\n    <paragraph>1.       \n      <literal> mysql -u root -p &lt;password&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>2. You should now have a &quot;mysql&gt;&quot; prompt, create a new database </line>\n      <literal>mysql&gt; create database &lt;name_of_database&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>3. Grant permissions </line>\n      <literal>mysql&gt; grant all on &lt;name_of_database&gt;.* to &lt;user&gt;@localhost identified by &apos;&lt;password&gt;&apos;; </literal>\n    </paragraph>\n    <paragraph>\n      <strong>PostgreSQL</strong>\n    </paragraph>\n    <paragraph>\n      <line>1. Become the PostgreSQL super user (normally called postgres) </line>\n      <literal>$ su &lt;postgres_super_user&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>2. Create a postgresql user</line>\n      <literal>$ createuser &lt;user&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>3. Create a database </line>\n      <literal>$ createdb &lt;name_of_database&gt;</literal>\n    </paragraph>\n    <section>\n      <header>Starting the setup guide</header>\n      <paragraph>1. Make sure you have met the eZ publish requirements</paragraph>\n      <paragraph>2. Go to         \n        <link id=\"6\">http://ez.no/developer/download</link> and download the latest release of eZ publish</paragraph>\n      <paragraph>\n        <line>3. Extract the downloaded eZ publish file somewhere on Apache&apos;s DocumentRoot </line>\n        <literal>$ tar xvfz ezpublish-xxx.tar.gz -C &lt;apache_document_root&gt;</literal>\n      </paragraph>\n      <paragraph>and rename it to something nice like &apos;ezpublish&apos;</paragraph>\n      <paragraph>4. Open a browser and enter the url for your eZ publish installation</paragraph>\n      <paragraph>5. Follow the setup guide instructions</paragraph>\n      <paragraph>6. When you have finished the setup guide you should be able to login on the admin page with &apos;admin&apos; as username and &apos;publish&apos; as password. If you installed demo data append &apos;/demo&apos; to the URL, if not append &apos;/user&apos; to view the user site.</paragraph>\n      <paragraph>See the         \n        <link id=\"12\">site access section</link> for more info on changing the way you access the user/admin site.</paragraph>\n      <paragraph>\n        <strong>Note</strong>: The setup guide creates a new settings/site.ini.php which overrides the default settings/site.ini</paragraph>\n    </section>\n  </section>\n</section>',1045487555,0);
