INSERT INTO ezcontentobject_attribute VALUES (317,'eng-GB',1,121,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>It&apos;s important that steps are taken to secure the site, more information on this can be read at Securing the site </paragraph>\n</section>',1045487555,0);
