INSERT INTO ezcontentobject_attribute VALUES (309,'eng-GB',2,118,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>You need to have Apache and PHP, and MySQL or PostgreSQL, installed to run eZ publish 3. PHP needs to have compiled-in support for either MySQL or PostgreSQL. For image conversion support you need to have GD compiled in PHP or ImageMagick installed on your system. </paragraph>\n  <paragraph>\n    <ul>\n      <li>\n        <line>PHP &gt;= 4.2.3 </line>\n        <line>\n          <link id=\"7\">http://www.php.net </link>\n        </line>\n      </li>\n      <li>Apache 1.3 (apache 2.0 works, but it is not well tested)        \n        <link id=\"8\">http://www.apache.org</link>\n      </li>\n      <li>\n        <line>Either MySQL or PostgreSQL</line>\n        <line>\n          <link id=\"9\">http://www.mysql.org</link>\n        </line>\n        <line>\n          <link id=\"10\">http://www.postgresql.org</link>\n        </line>\n      </li>\n      <li>\n        <line> ImageMagick and/or GD compiled in PHP for image conversion and scaling (not required) </line>\n        <line>\n          <link id=\"11\">http://www.imagemagick.org</link>\n        </line>\n      </li>\n    </ul>\n  </paragraph>\n  <paragraph>The installation processes for the above programs are very well documented on their respective home pages, so we will not include that here.</paragraph>\n</section>',1045487555,0);
