INSERT INTO ezcontentobject_attribute VALUES (323,'eng-GB',3,123,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>1. Go to       \n      <link id=\"6\">http://ez.no/developer/download</link> and download the latest version of eZ publish.</line>\n    <line>2. Unpack the downloaded file</line>\n  </paragraph>\n  <section>\n    <header>Database setup</header>\n    <paragraph>\n      <line>\n        <strong>MySQL</strong>\n      </line>\n      <line>We need to login, create a new database, grant permissions to a user and insert a database.</line>\n    </paragraph>\n    <paragraph>1. Open a console window (start-&gt;run-&gt;cmd.exe or start-&gt;run-&gt;command.exe depending on the Windows version)</paragraph>\n    <paragraph>2. Go to your the location of mysql and find the mysql.exe file (should be under bin\\)</paragraph>\n    <paragraph>\n      <line>3. Run</line>\n      <literal>mysql.exe -u root -p &lt;your_mysql_password&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>4. You should now have have a mysql&gt; prompt. Type these mysql statements </line>\n      <literal>mysql&gt; create database &lt;name_of_database&gt;;</literal>\n    </paragraph>\n    <paragraph>\n      <line>5. Grant permissions </line>\n      <literal>mysql&gt; grant all on .* to &lt;user&gt;@localhost identified by &apos;&lt;password&gt;&apos;; </literal>\n    </paragraph>\n    <paragraph>\n      <line>6. If you don&apos;t want demodata </line>\n      <literal>$ mysql.exe -u &lt;user&gt; -p&lt;password&gt; &lt;name_of_database&gt; &lt; &lt;httproot&gt;\\ezpublish-xxx\\kernel\\sql\\mysql\\kernel_clean.sql</literal>\n    </paragraph>\n    <paragraph>\n      <line>7.  If you do want demodata </line>\n      <literal>$ mysql.exe -u&lt;user&gt; -p&lt;password&gt; &lt;name_of_database&gt; &lt; &lt;httproot&gt;\\ezpublish-xxx\\kernel\\sql/mysql\\demokernel.sql</literal>\n    </paragraph>\n    <section>\n      <header>Demo data</header>\n      <paragraph>Demodata is only available for MySQL. Before you proceed make sure you installed the demokernel.sql file and NOT the kernel_clean.sql file.</paragraph>\n      <paragraph>To install the demodata all you have to do is unpack the var.tgz file</paragraph>\n      <paragraph>\n        <line>1. Go to your ezpublish directory</line>\n        <line>2. Unpack var.tgz into your ezpublish directory</line>\n      </paragraph>\n    </section>\n    <section>\n      <header>Configure eZ publish</header>\n      <paragraph>Open /ezpublish-xxx/settings/site.ini in notepad and set the correct settings in the [Database Settings] section. You need to set what database implementation you use, hostname of database server to connect to, user name, password, database name.</paragraph>\n      <paragraph>\n        <literal>[Database Settings]\n# Use either ezmysql or ezpostgresql\nDatabaseImplementation=ezpostgresql\n# Name of server to connect to\nServer=localhost\n# DB user name\nUser=&lt;user&gt;\n# DB Password\nPassword=&lt;password&gt;\n# database name you have created on previous step\nDatabase=&lt;name_of_database&gt;</literal>\n      </paragraph>\n    </section>\n    <section>\n      <header>Virtualhost setup</header>\n      <paragraph>You can use eZ publish with a virtualhost setup. When using a virtualhost you don&apos;t need to specify the index.php in the URL.</paragraph>\n      <paragraph>Make sure these lines exists in your apache config file and are not commented out:</paragraph>\n      <paragraph>\n        <literal>LoadModule rewrite_module modules/mod_rewrite.so\nAddModule mod_rewrite.c\n</literal>\n      </paragraph>\n      <paragraph>Below is a sample configuration for virtualhost setup. Include this in your apache config file and restart apache when you are done.</paragraph>\n      <paragraph>\n        <literal>&lt;VirtualHost &lt;your_ip_adress&gt;&gt;\n  &lt;Directory &lt;httproot&gt;/ezpublish-xxx/&gt;\n    Options FollowSymLinks Indexes ExecCGI\n    AllowOverride None\n  &lt;/Directory&gt;\n\n  RewriteEngine On\n  RewriteRule !\\.(gif|css|jpg|png|jar|js)$ /index.php\n\n  ServerAdmin root@localhost\n  DocumentRoot &lt;httproot&gt;/ezpublish-xxx\n  ServerName &lt;your_ip_adress&gt;\n&lt;/VirtualHost&gt;</literal>\n      </paragraph>\n      <paragraph>\n        <line>\n          <strong>Note:</strong> The rewrite rule is relative to the http root and uses &apos;/&apos; (slash) not &apos;\\&apos; (backslash)</line>\n      </paragraph>\n    </section>\n  </section>\n</section>',1045487555,0);
