INSERT INTO ezcontentobject_attribute VALUES (335,'eng-GB',3,127,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (336,'eng-GB',3,127,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Windows</header>\n    <section>\n      <header>Installer</header>\n      <paragraph>Click Start - Settings - Control panel. Open Add/Remove programs and find eZ publish on the list. Highlight eZ publish and click the Change/Remove button. This will delete eZ publish 3.</paragraph>\n      <paragraph>In addition you might want to remove the eZ systems directory because files created after the installation of eZ publish (e.g. Apache log files) are not deleted by the usual uninstall.</paragraph>\n    </section>\n    <section>\n      <header>Without Installer</header>\n      <paragraph>If you did not use the installer, simply remove your eZ publish directory.</paragraph>\n    </section>\n  </section>\n  <section>\n    <header>Linux and FreeBSD</header>\n    <section>\n      <header>Installer</header>\n      <paragraph>\n        <line>1. To uninstall eZ publish you must be root. Become root by typing </line>\n        <literal># su -</literal>\n      </paragraph>\n      <paragraph>and enter your root password when prompted for.</paragraph>\n      <paragraph>\n        <line>2. Go to your extracted ezpublish-xxx-xxx-i386 directory and run </line>\n        <literal># ./install.sh</literal>\n      </paragraph>\n      <paragraph>3. The installer automatically searches for an existing eZ publish 3 installation and highlights choice number two on the menu. Make sure choice number 2 &quot;Uninstall eZ publish&quot; is selected and press Enter.</paragraph>\n      <paragraph>If you installed eZ publish using the installer and you deleted the extracted installer directory afterwards, don&apos;t panic. It&apos;s easy to manual uninstall eZ publish.</paragraph>\n      <paragraph>\n        <line>1. To uninstall eZ publish you must be root. Become root by typing </line>\n        <literal># su - </literal>\n      </paragraph>\n      <paragraph>and enter your root password when prompted for.</paragraph>\n      <paragraph>\n        <line>2. Before we can remove any files, we need to stop both Apache and MySQL. First go to the bin directory located in /opt/ezpublish </line>\n        <literal># cd /opt/ezpublish/bin</literal>\n      </paragraph>\n      <paragraph>\n        <line>To stop Apache and MySQL run </line>\n        <literal># ./ezpublish stop</literal>\n      </paragraph>\n      <paragraph>\n        <line>3. Both Apache and MySQL should now be stopped. To remove all the eZ publish files run </line>\n        <literal># rm -fr /opt/ezpublish</literal>\n      </paragraph>\n      <paragraph>\n        <line>and remove the ezpublish lock file </line>\n        <literal># rm -f /var/state/ezpublish/ezpublish.lock</literal>\n      </paragraph>\n      <paragraph>All traces of eZ publish should now be gone.</paragraph>\n    </section>\n    <section>\n      <header>Without installer</header>\n      <paragraph>\n        <line>1. To uninstall eZ publish you must be root. Become root by typing </line>\n        <literal># su - </literal>\n      </paragraph>\n      <paragraph>and enter your root password when prompted for.</paragraph>\n      <paragraph>\n        <line>3. Now to remove all the eZ publish files just run </line>\n        <line># rm -fr /ezpublish-xxx</line>\n      </paragraph>\n    </section>\n  </section>\n  <section>\n    <header>Mac OS X</header>\n    <paragraph>\n      <line>1. To uninstall eZ publish you must be root. Become root by typing </line>\n      <literal># su -</literal>\n    </paragraph>\n    <paragraph>\n      <line>2. Now to remove all the eZ publish files just run</line>\n      <literal># rm -fr &lt;httproot&gt;/ezpublish-xxx</literal>\n    </paragraph>\n    <paragraph>\n      <line>All traces of eZ publish should now be gone.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (338,'eng-GB',1,128,124,'Site Access',0,0);
INSERT INTO ezcontentobject_attribute VALUES (339,'eng-GB',1,128,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>What is site access?</header>\n    <paragraph>Once you&apos;ve gotten eZ publish up and running on a server you need to configure the system. You can have several different sites running on the same eZ publish installation. To distinguish between these sites you need to set up something called site access. The site access defines how eZ publish will recognize which site you&apos;re accessing. eZ publish will then know which database to use, which design to show etc. </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (340,'eng-GB',1,128,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Site access configuration</header>\n    <section>\n      <header>Host</header>\n      <paragraph>\n        <line> In this example we will name our site &apos;www.mybookstore.com&apos; and we will use &apos;admin.mybookstore.com&apos; as the administration interface. To make eZ publish fetch site access from host names you need to configure a DNS server and point the domains to your web server. When your DNS is up and running and the names resolve to your web server and your eZ publish installation you need to make eZ publish recognize the names and use the correct configuration. To do this you open the configuration file found in &apos;settings/site.ini&apos; in the root of your eZ publish installation. In site.ini browse down to the section [SiteAccessSettings] and alter the configuration as shown below. Only the settings you need to change are shown below. </line>\n        <literal>file: settings/site.ini\n\n[SiteAccessSettings]\nMatchOrder=host\nHostMatchRegexp=^(.+)\\.mybookstore\\.com$\nHostMatchSubtextPost=\\.mybookstore\\.com\n</literal>\n      </paragraph>\n      <paragraph>\n        <line>Here we told eZ publish to take the part before .mybookstore.com of the url and map it to a directory in settings/siteaccess. If we enter &apos;www.mybookstore.com&apos; in our browser eZ publish will look a directory called &apos;www&apos; in settings/siteacces. Now that eZ publish knows how to distinguish between the two domains we need to create a configuration file for each site. This is done by creating two folders under &apos;settings/siteaccess/&apos; which corresponds to our matches ( &apos;www&apos; and &apos;admin&apos; ). In both these folder you need to create a file called site.ini.append. This is the configuration file which will be used to override any of the standard settings in eZ publish. We will keep our example simple and have just made a few settings to distinguish between the two sites. You can see the two configuration files below. </line>\n        <literal>file: settings/siteaccess/admin/site.ini.append\n\n[SiteSettings]\nLoginPage=custom\n\n[SiteAccessSettings]\nRequireUserLogin=true</literal>\n      </paragraph>\n      <paragraph> The configuration LoginPage=custom means that eZ publish will use a separate template for the login page of the administration site. RequireUserLogin=true tells eZ publish not to let anyone inside eZ publish unless they&apos;re logged into the system. </paragraph>\n      <paragraph>\n        <literal>file: settings/siteaccess/www/site.ini.append\n\n[DesignSettings]\nSiteDesign=mybookstore\n\n[SiteAccessSettings]\nRequireUserLogin=false\n</literal>\n      </paragraph>\n      <paragraph> The settings above applies to the website. SiteDesign=mybookstore means that eZ publish will prefer to use the design for the site found in design/mybookstore, RequireUserLogin=false is set so that users do not have to log into eZ publish to browse the website. </paragraph>\n      <section>\n        <header>Host Match Map</header>\n        <paragraph>\n          <line> In the previous example we used a regexp to map part of the url to different sites. This is a very powerful way of matching, but if you do not have experience or do not understand regexp, this approach might be difficult. Instead of regexp we can make a list of URL&apos;s and tell eZ publish 3 to match them to a site. See the configuration example below. </line>\n          <literal>file: settings/site.ini\n\n[SiteAccessSettings]\nMatchOrder=host\nHostMatchType=map\nHostMatchMapItems[]=mybookstore.com;user\nHostMatchMapItems[]=www.mybookstore.com;user\nHostMatchMapItems[]=admin.mybookstore.com;admin\n</literal>\n        </paragraph>\n        <paragraph> As you might see from the example we mapped &apos;mybookstore.com&apos; and &apos;www.mybookstore.com&apos; to the user site and &apos;admin.mybookstore.com&apos; to the admin site. To make individual settings for the two sites edit &apos;settings/siteaccess/user/site.ini.append&apos; and &apos;settings/siteaccess/admin/site.ini.append&apos;. The site.ini.append will override settings from &apos;settings/site.ini&apos;</paragraph>\n      </section>\n    </section>\n    <section>\n      <header>URI</header>\n      <paragraph>\n        <line> We will stick with the www.mybookstore.com example, but now we will use URI to recognize the different sites. http://www.mybookstore.com/index.php/admin will be our URL to the admin site and http://www.mybookstore/index.php the URL to our user site. Here we only need the &apos;www.mybookstore.com&apos; domain to point to our web server. In settings/site.ini set these settings: </line>\n        <literal>file: settings/site.ini\n\n[SiteSettings]\nDefaultAccess=user\n\n[SiteAccessSettings]\nMatchOrder=uri</literal>\n      </paragraph>\n      <paragraph> With the DefaultAccess variable we told eZ publish to use the &apos;user&apos; site if it is unable to match a site. Now eZ publish will take the last part of the entered URL and map it do a directory under settings/siteaccess/. If we now enter http://www.mybookstore.com/index.php/admin, eZ publish will look for a directory called &apos;admin&apos;. Using URI is useful when you want multiple sites but don&apos;t have a domain for each site or don&apos;t have the ability to setup virtual hosts for each site. This is the configuration the eZ publish Windows installer uses.</paragraph>\n    </section>\n    <section>\n      <header>Port</header>\n      <paragraph> By setting up site access to use ports we can let eZ publish distinguish different sites by mapping a port to a site. In this example we will use port 80 for the user site and port 81 for the admin site. When the configuration is done we should be able to access the user site on http://www.mybookstore.com:80 and the admin site with http://www.mybookstore.com:81. The settings in settings/site.ini required for this setup is shown below. </paragraph>\n      <paragraph>\n        <literal>file: settings/site.ini\n\n[SiteAccessSettings]\nMatchOrder=port\n\n[PortAccessSettings]\n80=user\n81=admin</literal>\n      </paragraph>\n    </section>\n  </section>\n  <section>\n    <header>Debug</header>\n    <paragraph>\n      <line> If you have problems getting your site access configuration right, you can turn on site access debugging. There are two settings for this. DebugAccess prints out the site access that was chosen, and DebugExtraAccess prints some extra information on access matching. </line>\n      <literal>file: settings/site.ini\n\n[SiteAccessSettings]\n\nDebugAccess=enabled\nDebugExtraAccess=enabled</literal>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
