below. </line>\n    <literal>file: settings/siteaccess/admin/site.ini.append\n\n[SiteSettings]\nLoginPage=custom\n\n[SiteAccessSettings]\nRequireUserLogin=true</literal>\n  </paragraph>\n  <paragraph>The configuration LoginPage=custom means that eZ publish will use a separate template for the login page of the administration site. RequireUserLogin=true tells eZ publish not to let anyone inside eZ publish unless they&apos;re logged into the system.</paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/www/site.ini.append\n\n[DesignSettings]\nSiteDesign=mybookstore\n\n[SiteAccessSettings]\nRequireUserLogin=false\n</literal>\n  </paragraph>\n  <paragraph>The settings above applies to the website. SiteDesign=mybookstore means that eZ publish will prefer to use the design for the site found in design/mybookstore, RequireUserLogin=false is set so that users do not have to log into eZ publish to browse the website.</paragraph>\n  <section>\n    <header>Host Match Map</header>\n    <paragraph>\n      <line>In the previous example we used a regexp to map part of the url to different sites. This is a very powerful way of matching, but if you do not have experience or do not understand regexp, this approach might be difficult. Instead of regexp we can make a list of URL&apos;s and tell eZ publish 3 to match them to a site. See the configuration example below. </line>\n      <literal>file: settings/site.ini\n\n[SiteAccessSettings]\nMatchOrder=host\nHostMatchType=map\nHostMatchMapItems[]=mybookstore.com;user\nHostMatchMapItems[]=www.mybookstore.com;user\nHostMatchMapItems[]=admin.mybookstore.com;admin\n</literal>\n    </paragraph>\n    <paragraph>\n      <line>As you might see from the example we mapped &apos;mybookstore.com&apos; and &apos;www.mybookstore.com&apos; to the user site and &apos;admin.mybookstore.com&apos; to the admin site. To make individual settings for the two sites edit &apos;settings/siteaccess/user/site.ini.append&apos; and &apos;settings/siteaccess/admin/site.ini.append&apos;. The site.ini.append will override settings from &apos;settings/site.ini&apos;</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (346,'eng-GB',2,131,127,'Port',0,0);
INSERT INTO ezcontentobject_attribute VALUES (347,'eng-GB',2,131,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>By setting up site access to use ports we can let eZ publish distinguish different sites by mapping a port to a site. In this example we will use port 80 for the user site and port 81 for the admin site. When the configuration is done we should be able to access the user site on http://www.mybookstore.com:80 and the admin site with http://www.mybookstore.com:81. The settings in settings/site.ini required for this setup is shown below.</paragraph>\n  <paragraph>\n    <literal>file: settings/site.ini\n\n[SiteAccessSettings]\nMatchOrder=port\n\n[PortAccessSettings]\n80=user\n81=admin</literal>\n  </paragraph>\n</section>',1045487555,0);
