INSERT INTO ezcontentobject_attribute VALUES (345,'eng-GB',2,130,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>We will stick with the www.mybookstore.com example, but now we will use URI to recognize the different sites. http://www.mybookstore.com/index.php/admin will be our URL to the admin site and http://www.mybookstore/index.php the URL to our user site. Here we only need the &apos;www.mybookstore.com&apos; domain to point to our web server. In settings/site.ini set these settings: </line>\n    <literal>file: settings/site.ini\n\n[SiteSettings]\nDefaultAccess=user\n\n[SiteAccessSettings]\nMatchOrder=uri</literal>\n  </paragraph>\n  <paragraph>\n    <line>With the DefaultAccess variable we told eZ publish to use the &apos;user&apos; site if it is unable to match a site. Now eZ publish will take the last part of the entered URL and map it do a directory under settings/siteaccess/. If we now enter http://www.mybookstore.com/index.php/admin, eZ publish will look for a directory called &apos;admin&apos;. Using URI is useful when you want multiple sites but don&apos;t have a domain for each site or don&apos;t have the ability to setup virtual hosts for each site. This is the configuration the eZ publish Windows installer uses.</line>\n  </paragraph>\n</section>',1045487555,0);
