INSERT INTO ezcontentobject_attribute VALUES (349,'eng-GB',1,132,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>If you have problems getting your site access configuration right, you can turn on site access debugging. There are two settings for this. DebugAccess prints out the site access that was chosen, and DebugExtraAccess prints some extra information on access matching. </line>\n    <literal>file: settings/site.ini\n\n[SiteAccessSettings]\n\nDebugAccess=enabled\nDebugExtraAccess=enabled</literal>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (33,'eng-GB',3,16,4,'Installation and configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (34,'eng-GB',3,16,119,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup guide which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup guide and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (294,'eng-GB',2,113,124,'Install using installers',0,0);
INSERT INTO ezcontentobject_attribute VALUES (295,'eng-GB',2,113,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>The installers are designed as a quick way to get eZ publish up and running for testing purposes. If you plan on using eZ publish for more than just testing, we recommend you install it manually, either by letting the setup guide do the configuration or by configuring eZ publish by hand.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (328,'eng-GB',3,125,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Virtualhost setups</header>\n    <paragraph>Virtualhost setups are secure by default since all request are sent to index.php script, with the exception of images, stylesheets and javascripts. The only thing that is required for securing the site is to make sure all custom made templates follow the       \n      <link id=\"13\">security guidelines for templates. </link>\n    </paragraph>\n  </section>\n  <section>\n    <header>Non-Virtualhost setups</header>\n    <paragraph>Non-Virtualhost setups are insecure by default. The index.php must explicitly be placed in the url, this means that any other scripts may be executed directly as well as open up .ini files with password information. Because of this it is not recommened to use non-virtualhost setups, however if you don&apos;t have any choice there are some guidelines which can be used to secure the site.</paragraph>\n    <paragraph>You also need to make sure that all custom made templates follow the       \n      <link id=\"13\">security guidelines for templates. </link>\n    </paragraph>\n    <section>\n      <header>Install a .htaccess file</header>\n      <paragraph>\n        <line>The Apache webserver allows each site to install a .htaccess file which can control which files are accessible as well as set PHP options. The .htaccess file is placed in the root of your eZ publish installation, an example of how it may look follows. </line>\n        <literal>&lt;FilesMatch &quot;.&quot;&gt;\norder allow,deny\ndeny from all\n&lt;/FilesMatch&gt;\n\n&lt;FilesMatch &quot;(index\\.php|\\.(gif|jpe?g|png))$&quot;&gt;\norder allow,deny\nallow from all\n&lt;/FilesMatch&gt;\n\nRewriteEngine On\nRewriteRule !\\.(gif|css|jpe?g|png|js)$ index.php\n\nDirectoryIndex index.php</literal>\n      </paragraph>\n    </section>\n    <section>\n      <header>Use .ini.php files</header>\n      <paragraph>All .ini files in eZ publish are readable when in non-virtualhost mode, this means that placing items such as usernames and passwords in these files are dangerous.</paragraph>\n      <paragraph>Fortunately the .ini file reader in eZ publish supports reading so called PHP wrapped .ini files. This means to create a file with the suffix .ini.php (.ini.append.php for append files), wrap it in a PHP comment and place it in the settings (settings/override for append files) directory. For instance the web setup will automatically create such files in settings/override/ for you with all the personal settings.</paragraph>\n    </section>\n    <section>\n      <header>site.ini.php</header>\n      <paragraph>\n        <literal>&lt;?php /*\n[DatabaseSettings]\nServer=mydbserver\nUser=myuser\nPassword=mypassword\n*/ ?&gt;</literal>\n      </paragraph>\n    </section>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (296,'eng-GB',2,113,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (326,'eng-GB',3,125,124,'Securing an eZ publish site',0,0);
INSERT INTO ezcontentobject_attribute VALUES (327,'eng-GB',3,125,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>Securing the site depends on whether you are using a virtualhost setup or a non-virtualhost setup. A virtualhost setup means that all urls are redirected to the index.php script while non-virtualhost requires that the index.php script is mentioned in the url.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (297,'eng-GB',2,113,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (33,'eng-GB',4,16,4,'Installation and configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (34,'eng-GB',4,16,119,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup guide which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup guide and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n  <paragraph>1. Choose a installation method, use either installer, setup guide or install manually.</paragraph>\n  <paragraph>2. Read about the installation method you picked.</paragraph>\n  <paragraph>3. If you did not use one of the installers, read about Site Access.</paragraph>\n  <paragraph>4. If you are planning on having multiple sites on one eZ publish installation read about Multi Site Configuration.</paragraph>\n  <paragraph>\n    <line>5.       \n      <strong>Important:</strong> Read about how to secure your site.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (33,'eng-GB',5,16,4,'Installation and configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (34,'eng-GB',5,16,119,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup guide which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup guide and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n  <paragraph>\n    <line>\n      <strong>What you need to get eZ publish installed and configured:</strong>\n    </line>\n    <line>1. Choose a installation method, use either installer, setup guide or install manually.</line>\n  </paragraph>\n  <paragraph>2. Read about the installation method you picked.</paragraph>\n  <paragraph>3. If you did not use one of the installers, read about Site Access. (if you used one of the installers, skip this)</paragraph>\n  <paragraph>4. If you are planning on having multiple sites on one eZ publish installation read about Multi Site Configuration. (if you used one of the installers, skip this)</paragraph>\n  <paragraph>\n    <line>5.       \n      <strong>Important:</strong> Read about how to secure your site. (if you used one of the installers, skip this)</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (33,'eng-GB',6,16,4,'Installation and configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (34,'eng-GB',6,16,119,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup guide which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup guide and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n  <paragraph>\n    <line>\n      <strong>What you need to get eZ publish installed and configured:</strong>\n    </line>\n    <line>1. Choose a installation method, use either       \n      <link id=\"17\">installer</link>,       \n      <link id=\"18\">setup guide</link> or       \n      <link id=\"19\">install manually</link>. If you don&apos;t know which installation method you want to choose, go       \n      <link id=\"13\">here</link>.</line>\n  </paragraph>\n  <paragraph>2. Read about the installation method you picked.</paragraph>\n  <paragraph>3. If you did not use one of the installers, read about     \n    <link id=\"14\">Site Access</link>. (if you used one of the installers, skip this)</paragraph>\n  <paragraph>4. If you are planning on having multiple sites on one eZ publish installation read about     \n    <link id=\"20\">Multi Site Configuration.</link> (if you used one of the installers, skip this)</paragraph>\n  <paragraph>\n    <line>5.       \n      <strong>Important:</strong> Read about how to       \n      <link id=\"15\">secure your site.</link> (if you used one of the installers, skip this)</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (329,'eng-GB',3,125,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (330,'eng-GB',2,126,124,'Multi Site Configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (331,'eng-GB',2,126,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>If you are setting up several sites with one eZ publish 3 installation using site access, you might want to separate the cache and storage directory. This will make things less cluttered and easy to manage when having many sites per installation.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (332,'eng-GB',2,126,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>The default settings in eZ publish 3 stores cache and files in a common directory for all sites. This can cause problems if you e.g. want to move one of the sites to another server in the future. This can be changed by setting some variables in your site.ini.append for each of your sites.</paragraph>\n  <paragraph>In this example we will separate storage files and cache for &apos;myfirst.ezpsite.com&apos;, &apos;admin.myfirst.ezpsite.com&apos;, &apos;mysecond.ezpsite.com&apos; and &apos;admin.mysecond.ezpsite.com&apos;. After setting up site access (which you can read more about     \n    <link id=\"16\">here</link>) we need to set some additional settings in the site.ini.append files.</paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/myfirst/site.ini.append\n[FileSettings]\nStorageDir=myfirst/storage\nCacheDir=myfirst/cache</literal>\n  </paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/admin.myfirst/site.ini.append\n[FileSettings]\nStorageDir=myfirst/storage\nCacheDir=myfirst/cache</literal>\n  </paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/mysecond/site.ini.append\n[FileSettings]\nStorageDir=mysecond/storage\nCacheDir=mysecond/cache</literal>\n  </paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/admin.mysecond/site.ini.append\n[FileSettings]\nStorageDir=mysecond/storage\nCacheDir=mysecond/cache</literal>\n  </paragraph>\n  <paragraph>Now we have told eZ publish to store myfirsts cache in var/myfirst/cache and myfirsts files in var/mysecond/storage. The same goes for the mysecond site.</paragraph>\n  <paragraph>Important: It is important that both the user and the admin site has the same storage directory. Otherwise if you e.g. upload a new file using the admin site, the user site will not be able to locate the file because it is looking for it in the wrong directory.</paragraph>\n  <paragraph>\n    <strong>Important:</strong> Make sure that Apache has sufficient rights for the folders you create.</paragraph>\n  <paragraph>\n    <line>\n      <strong>Note:</strong> The cache for ini-files and translations can not be separated as described in this document</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (333,'eng-GB',2,126,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (338,'eng-GB',3,128,124,'Site Access',0,0);
INSERT INTO ezcontentobject_attribute VALUES (339,'eng-GB',3,128,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>What is site access?</header>\n    <paragraph>\n      <line>Once you&apos;ve gotten eZ publish up and running on a server you need to configure the system. You can have several different sites running on the same eZ publish installation. To distinguish between these sites you need to set up something called site access. The site access defines how eZ publish will recognize which site you&apos;re accessing. eZ publish will then know which database to use, which design to show etc.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (340,'eng-GB',3,128,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (341,'eng-GB',3,128,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (33,'eng-GB',7,16,4,'Installation and configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (34,'eng-GB',7,16,119,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup guide which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup guide and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n  <paragraph>\n    <line>\n      <strong>What you need to get eZ publish installed and configured:</strong>\n    </line>\n    <line>1. Choose a installation method, use either       \n      <link id=\"17\">installer</link>,       \n      <link id=\"18\">setup guide</link> or       \n      <link id=\"19\">install manually</link>. If you don&apos;t know which installation method you want to choose, go       \n      <link id=\"13\">here</link>.</line>\n  </paragraph>\n  <paragraph>2. Read about the installation method you picked.</paragraph>\n  <paragraph>3. If you did not use one of the installers, read about     \n    <link id=\"21\">Site Access</link>. (if you used one of the installers, skip this)</paragraph>\n  <paragraph>4. If you are planning on having multiple sites on one eZ publish installation read about     \n    <link id=\"22\">Multi Site Configuration.</link> (if you used one of the installers, skip this)</paragraph>\n  <paragraph>\n    <line>5.       \n      <strong>Important:</strong> Read about how to       \n      <link id=\"23\">secure your site.</link> (if you used one of the installers, skip this)</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (318,'eng-GB',3,122,124,'Install eZ publish 3 manually',0,0);
INSERT INTO ezcontentobject_attribute VALUES (319,'eng-GB',3,122,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>You need to have Apache and PHP, and MySQL or PostgreSQL, installed to run eZ publish 3. PHP needs to have compiled-in support for either MySQL or PostgreSQL. For image conversion support you need to have GD compiled in PHP or ImageMagick installed on your system.</paragraph>\n  <paragraph>\n    <ul>\n      <li>\n        <line>PHP &gt;= 4.2.3 </line>\n        <line>\n          <link id=\"7\">http://www.php.net </link>\n        </line>\n      </li>\n      <li>\n        <line>Apache 1.3 (apache 2.0 works, but it is not well tested)</line>\n        <line>\n          <link id=\"8\">http://www.apache.org</link>\n        </line>\n      </li>\n      <li>\n        <line>Either MySQL or PostgreSQL</line>\n        <line>\n          <link id=\"9\">http://www.mysql.org</link>\n        </line>\n        <line>\n          <link id=\"10\">http://www.postgresql.org</link>\n        </line>\n      </li>\n      <li>\n        <line> ImageMagick and/or GD compiled in PHP for image conversion and scaling (not required) </line>\n        <line>\n          <link id=\"11\">http://www.imagemagick.org</link>\n        </line>\n      </li>\n    </ul>\n  </paragraph>\n  <paragraph>The installation processes for the above programs are very well documented on their respective home pages, so we will not include that here.</paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (320,'eng-GB',3,122,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section />',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (321,'eng-GB',3,122,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (324,'eng-GB',6,124,127,'Installation on Linux, FreeBSD and Mac OS X',0,0);
INSERT INTO ezcontentobject_attribute VALUES (325,'eng-GB',6,124,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>1. Go to       \n      <link id=\"6\">http://ez.no/developer/download</link> and download the latest version of eZ publish</line>\n    <line>2. Unpack ezpublish-xxx.tar.gz</line>\n    <literal> $ tar xvfz ezpublish-xxx.tar.gz -C &lt;httproot&gt;</literal>\n  </paragraph>\n  <paragraph>\n    <line>3. Now go to the extracted eZ publish directory </line>\n    <literal>$ cd &lt;httproot&gt;/ezpublish-xxx/</literal>\n  </paragraph>\n  <paragraph>\n    <line>4. Run the modfix.sh script </line>\n    <literal>$ bin/modfix.sh</literal>\n  </paragraph>\n  <section>\n    <header>Database setup</header>\n    <paragraph>\n      <line>\n        <strong>MySQL</strong>\n      </line>\n      <line>We need to login, create a new database, grant permissions to a user and insert a database</line>\n    </paragraph>\n    <paragraph>1.       \n      <literal>$ mysql -u root -p &lt;password&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>You should now have a &quot;mysql&gt;&quot; prompt, create a new database </line>\n      <literal>mysql&gt; create database &lt;name_of_database&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>2. Grant permissions </line>\n      <literal>mysql&gt; grant all on &lt;name_of_database&gt;.* to &lt;user&gt;@localhost identified by &apos;&lt;password&gt;&apos;;</literal>\n    </paragraph>\n    <paragraph>\n      <line>3. If you don&apos;t want to install demodata: </line>\n      <literal>$ mysql -u &lt;user&gt; -p&lt;password&gt; &lt;name_of_database&gt; &lt; &lt;httproot&gt;/ezpublish-xxx/kernel/sql/mysql/kernel_clean.sql</literal>\n    </paragraph>\n    <paragraph>\n      <line>If you want the demodata: </line>\n      <literal>$ mysql -u &lt;user&gt; -p&lt;password&gt; &lt;name_of_database&gt; &lt; &lt;httproot&gt;/ezpublish-xxx/kernel/sql/mysql/demokernel.sql</literal>\n    </paragraph>\n    <paragraph>\n      <line>\n        <strong>PostsgreSQL</strong>\n      </line>\n      <line>We need to login, create a new database, grant permissions to a user and insert a database.</line>\n    </paragraph>\n    <paragraph>\n      <line>Become the PostgreSQL super user (normally called postgres)</line>\n      <line>1. </line>\n      <literal>$ su &lt;postgres_super_user&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>2. Create a postgresql user</line>\n      <literal>$ createuser &lt;user&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>3. Create a database </line>\n      <literal>$ createdb &lt;name_of_database&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>4. Demodata is not available for PostgreSQL at the moment, so we have to install the kernel_clean.sql file</line>\n      <literal>$ psql -U &lt;ezpublish_user&gt;  &lt;name_of_database&gt; &lt; &lt;httproot&gt;/ezpublish-xxx/kernel/sql/postgresql/kernel_clean.sql</literal>\n    </paragraph>\n  </section>\n  <section>\n    <header>Demo data</header>\n    <paragraph>Demodata is only available for MySQL. Before you proceed make sure you installed the demokernel.sql file and NOT the kernel_clean.sql file.</paragraph>\n    <paragraph>To install the demodata all you have to do is unpack the var.tgz file</paragraph>\n    <paragraph>\n      <line>1. Go to /ezpublish-xxx/</line>\n      <literal>$ cd &lt;httproot&gt;/ezpublish-xxx</literal>\n    </paragraph>\n    <paragraph>\n      <line>2. Unpack var.tgz </line>\n      <literal>$ tar xvfz var.tgz</literal>\n    </paragraph>\n  </section>\n  <section>\n    <header>Configure eZ publish</header>\n    <paragraph>Open /ezpublish-xxx/settings/site.ini with your favourite editor and set the correct setting in the [Database Settings] section. You need to select what database implementation you would like to use, hostname of the database server to connect to, username, password and database name.</paragraph>\n    <paragraph>\n      <literal>[Database Settings]\n# Use either ezmysql or ezpostgresql\nDatabase Implementation=ezpostgresql\n# Name of server to connect to\nServer=localhost\n# DB user name\nUser=&lt;user&gt;\n# DB Password\nPassword=&lt;password&gt;\n# database name you have created in the previous step\nDatabase=&lt;name_of_database&gt;</literal>\n    </paragraph>\n  </section>\n  <section>\n    <header>Virtualhost setup</header>\n    <paragraph>You can use eZ publish with a virtualhost setup. When using a virtualhost you don&apos;t need to specify the index.php in the URL. Below is a sample configuration for virtualhost setup. Include this in your apache config file and restart apache when you are done.</paragraph>\n    <paragraph>\n      <literal>&lt;Virtualhost &lt;you_ip_address&gt;&gt;\n  &lt;Directory &lt;httproot&gt;/ezpublish-xxx/&gt;\n    Options FollowSymLinks Indexes ExecCGI\n    AllowOverride None\n  &lt;/Directory&gt;\n\n  RewriteEngine On\n  RewriteRule !\\.(gif|css|jpg|png|js)$ &lt;httproot&gt;/ezpublish-xxx/index.php\n\n  ServerAdmin root@localhost\n  DocumentRoot &lt;httproot&gt;/ezpublish-xxx/\n  ServerName &lt;you_ip_address&gt;\n&lt;/VirtualHost&gt;</literal>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (322,'eng-GB',7,123,127,'Installation on Windows',0,0);
INSERT INTO ezcontentobject_attribute VALUES (323,'eng-GB',7,123,128,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>1. Go to       \n      <link id=\"6\">http://ez.no/developer/download</link> and download the latest version of eZ publish.</line>\n    <line>2. Unpack the downloaded file</line>\n  </paragraph>\n  <section>\n    <header>Database setup</header>\n    <paragraph>\n      <line>\n        <strong>MySQL</strong>\n      </line>\n      <line>We need to login, create a new database, grant permissions to a user and insert a database.</line>\n    </paragraph>\n    <paragraph>1. Open a console window (start-&gt;run-&gt;cmd.exe or start-&gt;run-&gt;command.exe depending on the Windows version)</paragraph>\n    <paragraph>2. Go to your the location of mysql and find the mysql.exe file (should be under bin\\)</paragraph>\n    <paragraph>\n      <line>3. Run</line>\n      <literal>mysql.exe -u root -p &lt;your_mysql_password&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>4. You should now have have a mysql&gt; prompt. Type these mysql statements </line>\n      <literal>mysql&gt; create database &lt;name_of_database&gt;;</literal>\n    </paragraph>\n    <paragraph>\n      <line>5. Grant permissions </line>\n      <literal>mysql&gt; grant all on .* to &lt;user&gt;@localhost identified by &apos;&lt;password&gt;&apos;; </literal>\n    </paragraph>\n    <paragraph>\n      <line>6. If you don&apos;t want demodata </line>\n      <literal>$ mysql.exe -u &lt;user&gt; -p&lt;password&gt; &lt;name_of_database&gt; &lt; &lt;httproot&gt;\\ezpublish-xxx\\kernel\\sql\\mysql\\kernel_clean.sql</literal>\n    </paragraph>\n    <paragraph>\n      <line>7.  If you do want demodata </line>\n      <literal>$ mysql.exe -u&lt;user&gt; -p&lt;password&gt; &lt;name_of_database&gt; &lt; &lt;httproot&gt;\\ezpublish-xxx\\kernel\\sql\\mysql\\demokernel.sql</literal>\n    </paragraph>\n  </section>\n  <section>\n    <header>Demo data</header>\n    <paragraph>Demodata is only available for MySQL. Before you proceed make sure you installed the demokernel.sql file and NOT the kernel_clean.sql file.</paragraph>\n    <paragraph>To install the demodata all you have to do is unpack the var.tgz file</paragraph>\n    <paragraph>\n      <line>1. Go to your \\ezpublish-xxx directory</line>\n      <line>2. Unpack var.tgz into your \\ezpublish-xxx directory</line>\n    </paragraph>\n  </section>\n  <section>\n    <header>Configure eZ publish</header>\n    <paragraph>Open \\ezpublish-xxx\\settings\\site.ini in notepad and set the correct settings in the [Database Settings] section. You need to set what database implementation you use, hostname of database server to connect to, user name, password, database name.</paragraph>\n    <paragraph>\n      <literal>[Database Settings]\n# Use either ezmysql or ezpostgresql\nDatabaseImplementation=ezpostgresql\n# Name of server to connect to\nServer=localhost\n# DB user name\nUser=&lt;user&gt;\n# DB Password\nPassword=&lt;password&gt;\n# database name you have created on previous step\nDatabase=&lt;name_of_database&gt;</literal>\n    </paragraph>\n  </section>\n  <section>\n    <header>Virtualhost setup</header>\n    <paragraph>You can use eZ publish with a virtualhost setup. When using a virtualhost you don&apos;t need to specify the index.php in the URL.</paragraph>\n    <paragraph>Make sure these lines exists in your apache config file and are not commented out:</paragraph>\n    <paragraph>\n      <literal>LoadModule rewrite_module modules/mod_rewrite.so\nAddModule mod_rewrite.c\n</literal>\n    </paragraph>\n    <paragraph>Below is a sample configuration for virtualhost setup. Include this in your apache config file and restart apache when you are done.</paragraph>\n    <paragraph>\n      <literal>&lt;VirtualHost &lt;your_ip_adress&gt;&gt;\n  &lt;Directory &lt;httproot&gt;/ezpublish-xxx/&gt;\n    Options FollowSymLinks Indexes ExecCGI\n    AllowOverride None\n  &lt;/Directory&gt;\n\n  RewriteEngine On\n  RewriteRule !\\.(gif|css|jpg|png|jar|js)$ /index.php\n\n  ServerAdmin root@localhost\n  DocumentRoot &lt;httproot&gt;/ezpublish-xxx\n  ServerName &lt;your_ip_adress&gt;\n&lt;/VirtualHost&gt;</literal>\n    </paragraph>\n    <paragraph>\n      <line>\n        <strong>Note:</strong> The rewrite rule is relative to the http root and uses &apos;/&apos; (slash) not &apos;\\&apos; (backslash)</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
