INSERT INTO ezcontentobject_attribute VALUES (33,'eng-GB',8,16,4,'Installation and configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (34,'eng-GB',8,16,119,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>There are basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL, ImageMagick and set up everything needed to get eZ publish up and running. Another option is to use the eZ publish sources and follow the setup guide which will guide you through the steps of configuring your system for eZ publish. If you are little more experienced you can disable the setup guide and configure eZ publish 3 from scratch following the installation manual. If you don&apos;t want to install eZ publish 3 yourself you can always hire eZ systems to install the software for you. You can also buy a ready hosted eZ publish 3 solution.</paragraph>\n  <paragraph>\n    <line>\n      <strong>What you need to get eZ publish installed and configured:</strong>\n    </line>\n    <line>1. Choose a installation method, use either       \n      <link id=\"17\">installer</link>,       \n      <link id=\"18\">setup guide</link> or       \n      <link id=\"19\">install manually</link>. If you don&apos;t know which installation method you want to choose, go       \n      <link id=\"13\">here</link>.</line>\n  </paragraph>\n  <paragraph>2. Read about the installation method you picked.</paragraph>\n  <paragraph>3. If you did not use one of the installers, read about     \n    <link id=\"21\">Site Access</link>. (if you used one of the installers, skip this)</paragraph>\n  <paragraph>4. If you are planning on having multiple sites on one eZ publish installation read about     \n    <link id=\"22\">Multi Site Configuration.</link> (if you used one of the installers, skip this)</paragraph>\n  <paragraph>\n    <line>5.       \n      <strong>Important:</strong> Read about how to       \n      <link id=\"23\">secure your site.</link> (if you used one of the installers, skip this)</line>\n  </paragraph>\n</section>',1045487555,0);
