INSERT INTO ezcontentobject_attribute VALUES (330,'eng-GB',3,126,124,'Multi Site Configuration',0,0);
INSERT INTO ezcontentobject_attribute VALUES (331,'eng-GB',3,126,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>\n    <line>If you are setting up several sites with one eZ publish 3 installation using site access, you might want to separate the cache and storage directory. This will make things less cluttered and easy to manage when having many sites per installation.</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (332,'eng-GB',3,126,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>The default settings in eZ publish 3 stores cache and files in a common directory for all sites. This can cause problems if you e.g. want to move one of the sites to another server in the future. This can be changed by setting some variables in your site.ini.append for each of your sites.</paragraph>\n  <paragraph>In this example we will separate storage files and cache for &apos;myfirst.ezpsite.com&apos;, &apos;admin.myfirst.ezpsite.com&apos;, &apos;mysecond.ezpsite.com&apos; and &apos;admin.mysecond.ezpsite.com&apos;. After setting up site access (which you can read more about     \n    <link id=\"27\">here</link>) we need to set some additional settings in the site.ini.append files.</paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/myfirst/site.ini.append\n[FileSettings]\nStorageDir=myfirst/storage\nCacheDir=myfirst/cache</literal>\n  </paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/admin.myfirst/site.ini.append\n[FileSettings]\nStorageDir=myfirst/storage\nCacheDir=myfirst/cache</literal>\n  </paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/mysecond/site.ini.append\n[FileSettings]\nStorageDir=mysecond/storage\nCacheDir=mysecond/cache</literal>\n  </paragraph>\n  <paragraph>\n    <literal>file: settings/siteaccess/admin.mysecond/site.ini.append\n[FileSettings]\nStorageDir=mysecond/storage\nCacheDir=mysecond/cache</literal>\n  </paragraph>\n  <paragraph>Now we have told eZ publish to store myfirsts cache in var/myfirst/cache and myfirsts files in var/mysecond/storage. The same goes for the mysecond site.</paragraph>\n  <paragraph>Important: It is important that both the user and the admin site has the same storage directory. Otherwise if you e.g. upload a new file using the admin site, the user site will not be able to locate the file because it is looking for it in the wrong directory.</paragraph>\n  <paragraph>\n    <strong>Important:</strong> Make sure that Apache has sufficient rights for the folders you create.</paragraph>\n  <paragraph>\n    <line>\n      <strong>Note:</strong> The cache for ini-files and translations can not be separated as described in this document</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (333,'eng-GB',3,126,143,'',0,0);
INSERT INTO ezcontentobject_attribute VALUES (85,'eng-GB',3,40,125,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <paragraph>eZ publish 3 is the next generation of the popular open source content management system eZ publish. This version of eZ publish, though, is not only a totally re-engineered version with a lot of new, exciting functionality. eZ publish 3 has evolved into a development platform with several general PHP libraries for the rapid building of all sorts of PHP applications. Best of all: eZ publish is available for free under the GPL license. The latest version of eZ publish can be downloaded from ez.no at all times.</paragraph>\n  <paragraph>The eZ publish 3 development framework is a feature rich package. The libraries handles common operations including database abstraction, internationalization, template engine for content and design separation, XML parser and SOAP library. On top of the libraries you get the ready to use publishing functionality available in the eZ publish kernel. You have user defined content, integrated role based permission system, multilanguage features including UNICODE support, versioning of content, workflows, integrated search engine and an a full feature e-commerce engine to mention some features.</paragraph>\n  <paragraph>\n    <line>This article will show you how quickly you can set up eZ publish and how you can create custom websites with dynamic content. We will have a look at one content class and see how this is defined and how you can use it</line>\n  </paragraph>\n</section>',1045487555,0);
INSERT INTO ezcontentobject_attribute VALUES (86,'eng-GB',3,40,126,'<?xml version=\"1.0\" encoding=\"iso-8859-1\"?>\n<section>\n  <section>\n    <header>Installing</header>\n    <paragraph>\n      <line>You have basically four ways of installing eZ publish 3. You can use one of the supplied installer packages, which will install Apache, PHP, MySQL and set up everything needed to get eZ publish up and running. Another option is to use the publish sources and follow the setup wizard which will guide you through the steps of configuring your system for eZ publish. If you are a litle more experienced you can disable the setup wizard and configure eZ publish from scratch following the installation manual. If you don&apos;t want to install eZ publish yourself you can always hire eZ systems to install the software for you or buy a ready hosted eZ publish solution. We&apos;re not going to go into details about the installation here, you will find all the information you need in the installation manual.</line>\n    </paragraph>\n  </section>\n</section>',1045487555,0);
